(1, 'MDU000001', 'Tangible Movable Culture', 'Archival Holdings', 'MR. ORLANDO S. LAGMAN AND HIS WIFE', '2023-06-01', 'ORLANDO S. LAGMAN ', 'ORLANDO S. LAGMAN ', 'Mr. Orlando S. Lagman, a celebrated Filipino-American artist, dedicated his life to capturing the beauty of the world through his paintings. Renowned for his portraits, sacred art, and landscapes, he left an enduring mark in both the Philippines and the United States. Alongside him in his artistic journey was his beloved wife, a pillar of support and inspiration. Together, they built a life centered on creativity, faith, and service.', 'Orlando Lagman’s journey as an artist was not just a personal endeavor but a shared mission with his wife. She stood beside him through his years of service in the U.S. Navy, where he worked as a staff artist, and during his career as a professional portrait painter. While Orlando poured his soul into his canvases, his wife played a crucial role in managing their shared life, ensuring he had the time and space to create.\n\nTheir love was deeply rooted in faith and a commitment to giving back. When they visited the Philippines, they made meaningful contributions to the Diocese of Urdaneta, donating a portrait of the Divine Mercy, a symbol of their devotion and generosity.\n\nThrough the years, they faced challenges and triumphs, always supporting one another. Orlando’s art immortalized not just the faces of historical figures but also the love and partnership that he and his wife cherished. Their legacy continues to inspire, a testament to the power of art, love, and unwavering commitment.', '[\"artifacts-images\\/1740275789-1.JPG\"]', 11, NULL, NULL, 'Approved', NULL, '2025-02-21 09:12:30', '2025-03-08 10:04:07'),
(2, 'MDU000002', 'Tangible Movable Culture', 'Archival Holdings', 'DANILO ILDEFONSO', NULL, NULL, NULL, '- PHOTPO OF TWO-TIME PBA MOST VALUABLE PLAYER DANILO ILDEFONSO PRIDE OF URDANETA CITY, PANGASINAN ASLO NAME AS THE “DEMOLITION MAN” AND “LAKAY”.\n- TROPHY, JERSEY AND BALL WITH SIGNATURE OFTWO-TIME PBA MOST VALUABLE PLAYER DANILO ILDEFONSO PRIDE OF URDANETA CITY, PANGASINAN ASLO NAME AS THE “DEMOLITION MAN” AND “LAKAY”.', 'Danilo Ildefonso: The Pride of Urdaneta City, The \"Demolition Man\" and \"Lakay\"\n\nBorn and raised in Urdaneta City, Pangasinan, Danilo Ildefonso rose to become one of the most dominant players in Philippine basketball history. Known as the “Demolition Man” for his powerful inside presence and the nickname “Lakay” as a sign of respect for his leadership and experience, Ildefonso made a lasting impact on the Philippine Basketball Association (PBA).  \n\nHis journey to greatness was not easy. Coming from humble beginnings, he worked tirelessly to hone his skills, eventually earning a spot in the professional league. With his exceptional footwork, defensive tenacity, and scoring ability, he became a cornerstone of the San Miguel Beermen, leading them to multiple championships.  \n\nA two-time PBA Most Valuable Player (MVP), Ildefonso’s legacy is one of perseverance and excellence. Beyond his achievements on the court, he remains an inspiration to young athletes, proving that with dedication and hard work, even a small-town boy from Urdaneta can reach the pinnacle of Philippine basketball. Today, he continues to give back to the sport, mentoring the next generation of players and ensuring that his legacy as a proud son of Urdaneta City lives on.', '[\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_6 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_7 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_5 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_3 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_4 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_2 (1).jpg\",\"artifacts-images\\/1740101665-12131313.jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 09.04_1 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 08.52_19 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 08.52_20 (1).jpg\",\"artifacts-images\\/1740101665-CamScanner 06-15-2023 08.52_21.jpg\"]', 1, NULL, NULL, 'Approved', NULL, '2025-02-21 09:34:25', '2025-02-27 05:38:59'),
(3, 'MDU000003', 'Tangible Movable Culture', 'Archival Holdings', 'BAGONG BABAE” AND “NENITA', NULL, NULL, NULL, 'A PHOTO AND SKETCHES OF URDANETANIAN WHO BECAME FAMOUS IN THE MUSIC INDUSTRY, DEE-JAY\nIGNACIO ALVARO OR ALSO KNOWN AS DJ ALVARO. SHE MADE HER DEBUT IN 1994 OF THE ALBUM\n', '**DJ Alvaro: The Urdanetanian Icon in the Music Industry**  \n\nHailing from Urdaneta City, Pangasinan, Dee-Jay Ignacio Alvaro, popularly known as DJ Alvaro, made a significant impact on the Philippine music scene. With her unique sound and bold artistry, she debuted in 1994 with the albums *\"Bagong Babae\"* and *\"Nenita\"*, both of which resonated with audiences for their fresh take on Filipino rock and pop music.  \n\nDJ Alvaro became a symbol of empowerment, using her music to break stereotypes and inspire women to embrace their individuality. Her distinct voice, combined with her fearless approach to music, allowed her to carve a niche in the industry, making her one of the most influential female artists of her time.  \n\nHer legacy continues to inspire new generations of musicians, proving that talent and passion, when combined with determination, can turn dreams into reality.', '[\"artifacts-images\\/1740102627-AAASASA.jpg\",\"artifacts-images\\/1740102627-1.jpg\",\"artifacts-images\\/1740102627-CamScanner 06-15-2023 08.46_10 (1).jpg\",\"artifacts-images\\/1740102627-6.jpg\",\"artifacts-images\\/1740102627-CamScanner 06-15-2023 08.46_9.jpg\",\"artifacts-images\\/1740102627-5.jpg\",\"artifacts-images\\/1740102627-4.jpg\",\"artifacts-images\\/1740102627-3.jpg\",\"artifacts-images\\/1740102627-2.jpg\",\"artifacts-images\\/1740102627-CamScanner 06-15-2023 08.46_3 (1).jpg\",\"artifacts-images\\/1740102627-CamScanner 06-15-2023 09.04_9 (1).jpg\",\"artifacts-images\\/1740102627-CamScanner 06-15-2023 09.04_10.jpg\"]', 1, NULL, NULL, 'Approved', NULL, '2025-02-21 09:50:27', '2025-02-27 23:22:25'),
(4, 'MDU000004', 'Tangible Movable Culture', 'Ethnographic Object', 'OLD IRON', '2023-05-25', 'Costales', 'Pinmaludpod E.S.', '- 1st Batch Electric Iron\n-  Lacasa 18th Century', '**The Evolution of Ironing: From Tradition to Innovation**  \n\nIn a time when technology was still in its infancy, people relied on simple yet effective tools to make daily life easier. Among these were the traditional irons, each reflecting a different era of innovation.  \n\nThe *Lacasa 18th Century* iron (rightmost) represents the early days of pressing clothes, using heated charcoal placed inside to maintain warmth. This method, while effective, required constant monitoring and skillful handling to avoid burning garments.  \n\nAs time progressed, the middle iron, an improved model, showcased the transition towards metal-heated irons, where users would place them over a fire or stove before using. This reduced the need for charcoal but still demanded effort and precision.  \n\nFinally, the *1st Batch Electric Iron* (leftmost) marked a significant leap in household convenience. With the introduction of electricity, ironing became more efficient, requiring less effort while providing consistent heat. This innovation paved the way for modern appliances that we now take for granted.  \n\nThese artifacts serve as a reminder of how simple tools evolved over time, showcasing human ingenuity and the continuous pursuit of making life easier.', '[\"artifacts-images\\/1740103733-IMG_8220.JPG\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 10:08:53', '2025-03-08 08:10:07'),
(5, 'MDU000005', 'Tangible Movable Culture', 'Antiques Objects', 'WEINSTEIN CURVEX ACOUSTIC PIANO', '2023-08-02', 'Perez', 'Ridao', 'Old piano in the lifestyle gallery ', 'Located in the Lifestyle Gallery, the Weinstein Curvex Acoustic Piano stands as a timeless piece of musical craftsmanship. Its rich, resonant tones once filled homes and halls with melodies that transcended generations. This beautifully preserved piano symbolizes the enduring charm of classical music and vintage artistry.  \n', '[\"artifacts-images\\/1740105973-CamScanner 06-20-2023 09.01_1.jpg\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 10:46:13', '2025-02-21 21:03:57'),
(6, 'MDU000006', 'Tangible Movable Culture', 'Ethnographic Object', 'FLORENCIO ANDAYA AŇO BELL', '2023-06-23', 'Lachica', ' Florencio Andaya Año', 'This bronze bell, donated by Florencio Andaya Año in 1893, stands as a testament to faith, generosity, and the rich history of Urdaneta City, Pangasinan. Once housed in the town\'s church, the bell served as a call to prayer, a marker of time, and a witness to the changing eras.\n\nCrafted with precision and inscribed with its donor’s name, this bell rang through decades of devotion, summoning the faithful for worship and accompanying the town through celebrations and hardships alike. Its deep, resonant tone once echoed across the fields, summoning farmers, traders, and townsfolk to gather in unity.\n\nNow preserved as a historical artifact, the bell symbolizes the enduring spirit of Urdaneta and its people. Though it no longer tolls from a belfry, its legacy remains—a voice from the past that continues to inspire generations.', 'In the heart of Urdaneta City, Pangasinan, where the land bore the fruits of labor and the people held faith close to their hearts, there once stood a church longing for a voice. For years, the faithful gathered under its roof, yet there was no bell to call them to prayer, no sound to echo through the town, signaling the rhythm of their daily devotion.  \n\nFlorencio Andaya Año, a man known for his generosity and deep faith, saw this need and took it upon himself to change it. In 1893, using his own wealth, he commissioned the casting of a great bronze bell—a gift not just to the church, but to the entire town.  \n\nForged with skill and blessed with prayers, the bell arrived in Urdaneta, gleaming under the tropical sun. The townspeople marveled at its craftsmanship, its sturdy form bearing the name of its donor and the year of its birth. With great effort, they lifted it to the church’s belfry, securing it in its rightful place.  \n\nOn its first toll, the bell rang deep and clear, its voice cutting through the air like a hymn from the heavens. It called the farmers from their fields, the fishermen from the riverbanks, and the children from their play. It marked the passing of time, announcing weddings, mourning deaths, and proclaiming peace even in times of war.  \n\nThrough the years, the bell witnessed history—colonial struggles, revolutions, and the rise of a modern city. It remained steadfast, a guardian of the faith and a symbol of the unity of the people of Urdaneta. Though time weathered its surface, and the old belfry no longer cradled its weight, the bell found a new home in a museum, where it now rests as a relic of the past.  \n\nBut even in silence, it speaks. Visitors who stand before it can almost hear its echo, a reminder of devotion, sacrifice, and the enduring spirit of a town that still listens for its call.  \n', '[\"artifacts-images\\/1740145838-CamScanner 06-20-2023 08.56 (1)_1.jpg\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 21:50:38', '2025-02-21 21:50:38'),
(7, 'MDU000007', 'Tangible Movable Culture', 'Numismatic', 'OLD DIFFERENT MONEY AND COINS COLLECTION', '2023-06-19', 'N/A', 'N/A', 'This remarkable collection of paper money, coins, and stamps from different countries and eras is a tangible link to history, trade, and culture. Each bill and coin carries a story—of economic shifts, colonial influences, national pride, and global connections. The display includes Philippine pesos, U.S. dollars, Chinese yuan, Japanese yen, Korean won, and other international currencies, alongside historic coins that have passed through countless hands over the decades.\n\nAccompanying the currency is a stamp collection, showcasing the artistry and significance of postal history. Also included are old documents, a pair of glasses, and a miniature bell, adding to the mystery and historical value of this exhibit', 'Many years ago, an old merchant named Don Ricardo roamed the world, trading silk in China, spices in the Philippines, and gold in the Americas. His journey was one of discovery—each port, each handshake, and each exchange left him with more than just goods; he collected the currencies of the lands he visited.\n\nHe marveled at how each banknote bore the faces of leaders, the symbols of revolutions, and the hopes of nations. Coins jingled in his pockets, stamped with the emblems of empires that had risen and fallen. He kept these treasures not for their value in trade, but as mementos of places he once called home.\n\nAs years passed, his collection grew, filling books and chests with the wealth of history. But as he aged, Don Ricardo knew that these artifacts belonged not just to him but to the people who would come after him—to scholars, dreamers, and historians who would one day study them.\n\nThus, he donated his collection to a museum, ensuring that the echoes of his travels would never be forgotten. Today, as visitors gaze upon these bills and coins, they, too, embark on a journey through time—connecting with distant lands, forgotten kings, and the ever-changing tides of history.', '[\"artifacts-images\\/1740146964-CamScanner 06-19-2023 13.47 (1)_1.jpg\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 22:09:24', '2025-02-21 22:09:24'),
(8, 'MDU000008', 'Tangible Movable Culture', 'Books', 'A BETTER LIVING', NULL, 'Pedro T. Orata', 'Family of Orata', 'A BOOK OF EDUCATION IS A BETTER LIVING BY PEDRO T. ORATA\n\nThis aged green book, Education is a Better Living by Pedro T. Orata, is a testament to the power of education in transforming lives. Orata, a renowned Filipino educator, was a champion of rural education and believed that knowledge was the key to economic and social progress. His work emphasized practical learning, accessibility, and the importance of education in improving livelihoods, particularly for marginalized communities.\n\nThe worn-out cover and delicate pages of this book suggest its significance—it has likely been read, studied, and passed through generations of learners. Its presence in this museum reflects the enduring legacy of education in shaping the future.\n', 'In a quiet barrio, where farming was the way of life, young Carlos dreamed of more than just tending fields. His father, a farmer, had always believed that education was for the wealthy, but Carlos saw something different in an old book tucked away in their town library—Education is a Better Living by Pedro T. Orata.\n\nAs he flipped through its pages, he read about how education could open doors, how learning practical skills could improve communities, and how knowledge could be the greatest tool for progress. Inspired, Carlos pursued his studies despite the odds. He worked during the day and studied under the dim glow of an oil lamp at night. Years later, he became a teacher, bringing education to children in his town, just as Orata had envisioned.\n\nThe book that once guided him was now in his classroom, its pages worn but its message alive. It had not only changed one boy’s life but had shaped the future of an entire community.\n', '[\"artifacts-images\\/1740147353-1.jpg\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 22:15:53', '2025-02-21 22:15:53'),
(9, 'MDU000009', 'Tangible Movable Culture', 'Ethnographic Materials', 'SAYA', '2023-06-23', 'Lea Sebejana', 'Sebejana Family', 'These two mannequins represent traditional Filipino women\'s attire from different periods, highlighting the elegance and cultural significance of the saya.\n\nFirst Mannequin (Left)\n\nWears a Baro’t Saya, a classic ensemble consisting of a sheer embroidered blouse (baro) and a long skirt (saya).\nThe outfit is adorned with a checkered scarf (alampay) draped over the shoulder, commonly worn by women in rural areas for both aesthetic and functional purposes.\nThe design reflects the Spanish colonial influence on Filipino fashion, blending modesty with intricate craftsmanship.\nSecond Mannequin (Right)\n\nShowcases a more modernized version of the saya, featuring a crocheted white skirt and a delicate, embroidered brown blouse.\nA long antique-style necklace complements the outfit, emphasizing Filipino jewelry craftsmanship.\nThis attire is reminiscent of early 20th-century Filipina clothing, symbolizing the transition from colonial styles to more contemporary adaptations.', 'These mannequins represent the evolution of women’s fashion in the Philippines, reflecting different social classes and historical influences. The Baro’t Saya was a staple for Filipinas during the Spanish colonial era, often worn for formal occasions or daily activities, depending on the fabric and embellishments. Over time, variations emerged, adapting to modern tastes while preserving traditional elements.\n\nIn a museum setting, these mannequins serve as a tribute to the resilience and grace of Filipina women throughout history. They stand as silent narrators of a past where clothing was not only a means of expression but also a reflection of social identity and cultural pride.', '[\"artifacts-images\\/1740148289-LASSSS.jpg\",\"artifacts-images\\/1740148289-LASS.jpg\"]', 1, NULL, NULL, 'Approved', NULL, '2025-02-21 22:31:29', '2025-03-05 09:34:24'),
(10, 'MDU000010', 'Tangible Movable Culture', 'Fine Arts', 'POPE BENEDICT XVI', '2023-03-25', 'N/A', 'N/A', 'The poster features a dignified image of Pope Benedict XVI, capturing his serene expression and the gentle authority he embodied during his papacy. Dressed in his traditional white cassock and papal regalia, the Pope is depicted with a backdrop that subtly incorporates elements reminiscent of Urdaneta City, such as the silhouette of the Minor Basilica of Our Lady of the Most Holy Rosary of Manaoag, a revered pilgrimage site in Pangasinan. The artwork blends the universal significance of the Pope with local cultural landmarks, symbolizing the deep connection between the Vatican and the Filipino Catholic community.', 'In the bustling heart of Urdaneta City, a small art studio stood tucked between rows of ancestral houses. Here, Isabel, a local artist known for her devotion and talent, spent her days bringing religious figures to life on canvas. When Pope Benedict XVI announced his visit to the Philippines, the entire nation buzzed with excitement, and Urdaneta City was no exception.\n\nThe local parish approached Isabel with a special request: to create a poster commemorating the Pope\'s visit, intertwining his image with symbols of their beloved city. Honored and inspired, Isabel set to work, pouring her faith and artistry into the project.\n\nShe chose to portray Pope Benedict XVI with a serene expression, capturing his spiritual depth. Behind him, she painted the iconic silhouette of the Minor Basilica of Our Lady of the Most Holy Rosary of Manaoag, its spires reaching towards the heavens. The background blended the Vatican\'s grandeur with the lush landscapes of Pangasinan, symbolizing the unity of the global Church and the local community.\n\nUpon completion, the poster was unveiled during a special mass. The congregation was moved, seeing their faith and heritage reflected in the artwork. Copies of the poster adorned homes, schools, and public spaces throughout Urdaneta City, serving as a lasting reminder of the Pope\'s visit and the enduring bond between the Vatican and the Filipino faithful.', '[\"artifacts-images\\/1740149624-IMG_8299.JPG\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 22:53:44', '2025-02-21 22:53:44'),
(11, 'MDU000011', 'Significant Personalities', NULL, 'GEORGE ALLEN', NULL, NULL, NULL, 'PAINTED BY ORLANDO LAGMAN ORIGINAL ON DISPLAY AT PENTAGON, USA, 1966\n\nGeorge Allen was a highly respected and influential coach in the world of football and rugby, known for his tactical brilliance, leadership, and ability to inspire his players. While most widely recognized for his contributions to American football, he was also deeply involved in rugby, bringing a disciplined and strategic approach to the game. His coaching philosophy emphasized strong defense, relentless teamwork, and meticulous preparation, making him a legend in the field of sports.\n\n', 'From an early age, George Allen was captivated by the intensity and strategy of contact sports. Raised in a family that valued athletic excellence, he played both football and rugby during his college years. Though football dominated his early career, he never lost his passion for the raw, strategic nature of rugby.\n\nAfter a successful tenure coaching American football at both collegiate and professional levels, Allen turned his attention to rugby. While many saw the two sports as vastly different, he recognized the similarities—teamwork, endurance, and mental toughness. He began working with young athletes, integrating football-inspired defensive formations into rugby training sessions. His innovative methods led to unexpected success, with his teams gaining recognition for their disciplined play and strong defensive structures.\n\nThroughout his career, Allen’s influence extended beyond the field. He was known for his mentorship, developing young players into leaders both in sports and in life. His legacy remains a testament to his belief in discipline, teamwork, and the unbreakable spirit of competition.', '[\"artifacts-images\\/1740150239-71.jpg\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-21 23:03:59', '2025-02-21 23:03:59'),
(12, 'MDU000012', 'Tangible Movable Culture', 'Certificates', 'Orlando Lagman VIP Professional', '2025-02-22', 'Inherit Famity Lagman', 'Angelika Lagman', 'AWARDS OF RECOGNITION VIP PROFESSIONAL\n\nThe Awards of Recognition: VIP Professional is a distinguished event that honors individuals who have demonstrated excellence, leadership, and significant contributions in their respective fields. This year, the prestigious recognition is awarded to Orlando Lagman, a VIP Professional known for his dedication, expertise, and impact in his industry.\n\nThe event will feature a formal awarding ceremony, a tribute video showcasing his professional journey, and a keynote speech highlighting his contributions and legacy. Colleagues, family, and friends will gather to celebrate his success, making this a momentous occasion of recognition and inspiration.', 'From humble beginnings to becoming a VIP Professional, Orlando Lagman’s story is one of perseverance, passion, and success. With years of experience and dedication in his field, he has earned the respect of his peers and the admiration of those he has mentored.\n\nHis journey started with a vision—to make a meaningful impact through his work. Through tireless effort, he rose through the ranks, overcoming challenges and setting new standards of excellence. His leadership, commitment, and innovation have not only advanced his career but have also inspired others to strive for greatness.\n\nThe VIP Professional Award is a testament to Orlando Lagman’s hard work and influence. As he receives this recognition, he stands as a r', '[\"artifacts-images\\/1740195870-IMG_8317.JPG\"]', 1, '2025-03-08', 'Ok passed', 'Approved', NULL, '2025-02-22 11:44:30', '2025-02-27 13:19:55'),
(13, 'MDU000013', 'Tangible Movable Culture', 'Antiques Objects', 'ANTIQUE CHANDELIER', '2000-06-06', 'Perez Family', 'Perez Family', 'The Antique Chandelier of Perez is a magnificent piece of history, a testament to the craftsmanship and elegance of a bygone era. Crafted with intricate metalwork and adorned with delicate glass or crystal embellishments, this chandelier once illuminated grand halls and noble residences. Its timeless design reflects the artistry of its time, blending function and beauty to create a radiant centerpiece.\n\nOver the years, the chandelier has become more than just a lighting fixture—it is a symbol of heritage, luxury, and tradition. Though it may bear the marks of age, its enduring charm continues to captivate those who admire antique treasures.', 'ong ago, in the grand ancestral home of the Perez family, a magnificent chandelier hung at the heart of their spacious living hall. It was said to have been imported from Europe, a gift to the family by a renowned merchant as a token of gratitude for their hospitality. Made of finely crafted bronze and adorned with sparkling crystals, the chandelier bathed the room in a warm, golden glow during gatherings and celebrations.\n\nGenerations of the Perez family grew up under its light, sharing stories, laughter, and moments that would become cherished memories. As time passed, the house aged, and the chandelier, once shining brilliantly, began to dim. Dust and rust dulled its elegance, but its history remained alive in the hearts of those who lived beneath it.\n\nDetermined to restore its former glory, the family embarked on a meticulous restoration project. Skilled artisans carefully polished the metal, replaced missing crystals, and rewired the fixture to bring back its radiant glow. When the restoration was complete, the chandelier shone once again, just as it had in its prime.\n\nToday, the Antique Chandelier of Perez stands as a symbol of resilience and the enduring beauty of heritage. It reminds us that history, when cared for and preserved, can continue to shine brightly, illuminating the past for future generations to admire.', '[\"artifacts-images\\/1740369711-CHANDELIER.jpg\"]', 0, '2025-02-13', 'test1234', 'Approved', NULL, '2025-02-24 12:01:51', '2025-03-05 15:03:11'),
(14, 'MDU000014', 'Tangible Movable Culture', 'Fine Arts', 'AWARDS OF RECOGNITION VIP PROFESSIONAL', '2017-01-27', 'Inherit perez family', 'Perez Family', 'Test', 'Test', '[\"artifacts-images\\/1740635916-IMG_8237.JPG\"]', 0, NULL, NULL, 'Approved', NULL, '2025-02-27 13:58:36', '2025-02-27 13:59:42'),
(15, NULL, 'Significant Natural Resources', 'Bodies of Water', 'Seed Urn', '2025-03-05', 'Aldong', 'Angel', 'It is believed that one will be granted a special power by proving their inheritance to the urn with blood, and focusing on one\'s desire for the crown.', 'A Guardian Spirit Beast (守しゅ護ご霊れい獣じゅう, Shugo Reijū) is a parasitic-type Nen beast created by the Seed Urn Ceremony. Participants of the ceremony each become a host to one Guardian Spirit Beast. All participants/hosts seen thus far have either been the king or a legitimate prince of the Kakin Empire.[1] They are instrumental to the unfolding of the Succession Contest.', '[\"artifacts-images\\/1741178776-images.jpg\"]', 0, NULL, NULL, 'Pending', NULL, '2025-03-05 20:46:16', '2025-03-05 20:46:16'),
(16, 'MDU000016', 'Tangible Movable Culture', 'Fine Arts', 'ORLANDO S. LAGMAN NATURE PAINTINGS', '2023-07-01', 'Inherit Orlando Family', 'Orlando Family', 'The Orlando S. Lagman Nature Paintings is a collection of exquisite landscape and nature-inspired artworks created by the late Orlando S. Lagman, a renowned Filipino painter known for his mastery in capturing the beauty of the natural world. These paintings, completed in various mediums, reflect the artist’s deep appreciation for the environment, showcasing lush forests, serene rivers, and vibrant wildlife. Each piece embodies Lagman’s unique style, blending realism with impressionistic elements, and serves as a testament to his love for nature and his artistic legacy.', 'Orlando S. Lagman dedicated his life to portraying the breathtaking landscapes of the Philippines, often drawing inspiration from the countryside he explored as a young artist. His works not only depict nature’s beauty but also serve as a visual reminder of the importance of conservation and environmental awareness.  \n\nAfter his passing, the Orlando S. Lagman Nature Paintings were cherished by his family as a part of their heritage. The Lagman family, recognizing the cultural and artistic significance of these works, generously donated them to the Museo de Urdaneta on July 1, 2023. This donation was made to ensure that Lagman’s artistic contributions continue to inspire future generations and to honor his enduring passion for nature.  \n\nNow housed in the museum, the collection allows visitors to immerse themselves in the tranquility and splendor of the natural world through the eyes of a masterful artist.', '[\"artifacts-images\\/1741396174-NATURE PAINTING BY ORLANDO S. LAGMAN_3.JPG\",\"artifacts-images\\/1741396174-NATURE PAINTING BY ORLANDO S. LAGMAN_2.JPG\",\"artifacts-images\\/1741396174-NATURE PAINTING BY ORLANDO S. LAGMAN_1.JPG\"]', 0, NULL, NULL, 'Approved', NULL, '2025-03-08 09:09:34', '2025-03-08 09:09:34'),
(17, NULL, 'Tangible Movable Culture', 'Fine Arts', 'SCULTURA DE URDANETA', '2025-03-08', 'Sheila Marie Gonzaga', 'Gonzaga Family', 'The *Scultura de Urdaneta Map is a rare and historically significant artifact, featuring the Universi Orbis Seu Terreni Globi map created by the Flemish cartographer Gerard de Jode in 1578. This map, a remarkable example of Renaissance cartography, presents a detailed representation of the known world during the late 16th century. It includes early depictions of the Philippine archipelago, highlighting the maritime routes and discoveries influenced by Spanish explorers, including the renowned navigator and Augustinian friar, Andrés de Urdaneta. The map is an exquisite engraving, reflecting the craftsmanship and geographic knowledge of its time, making it a valuable piece of historical and artistic importance.  \n', 'During the Age of Exploration, maps like Universi Orbis Seu Terreni Globi played a crucial role in shaping global navigation, trade, and colonial expansion. Gerard de Jode, a prominent mapmaker and publisher in Antwerp, created this map as part of his ambitious world atlas, *Speculum Orbis Terrarum*. Although his works were overshadowed by those of his competitor, Abraham Ortelius, de Jode\'s maps remain significant for their precision and artistic quality.  \n\nThe Scultura de Urdaneta Map is particularly valuable to Philippine history as it features one of the earliest European cartographic depictions of the region, influenced by the voyages of Andrés de Urdaneta. Urdaneta, a key figure in the Spanish expeditions to the Philippines, charted the vital return route from the islands to Mexico, known as the Tornaviaje, which shaped the Manila-Acapulco Galleon Trade for centuries.  \n\nThis artifact was preserved and eventually acquired as part of the cultural collection of Museo de Urdaneta. It stands as a tribute to the intertwined legacies of European cartography and Philippine maritime history, offering visitors a glimpse into the world as it was envisioned by Renaissance explorers and scholars.', '[\"artifacts-images\\/1741398804-JAPANESE WORLD WAR II SHRINE_1.jpg\"]', 0, NULL, NULL, 'Pending', NULL, '2025-03-08 09:53:24', '2025-03-08 09:53:24');
