(3, 4, 'NCCA Employee ID', 'Shin', 'Akin', 'Tan', NULL, '09247382634', 'shin@gmail.com', '2025-02-23', '[\"Missing Parts\"]', '[\"artifacts-images\\/1740290960-IMG_8219.JPG\"]', 'test', '2025-02-23', '[\"Handle complete\"]', '[\"artifacts-images\\/1740318753-362124994_1640426053145835_5655626758879896427_n.jpg\"]', 'Restoring old iron artifacts is more than just a process—it is a commitment to preserving history, craftsmanship, and cultural heritage. Each piece of iron carries the weight of time, telling stories of innovation, resilience, and human ingenuity. Through careful restoration, we breathe new life into these historical treasures, ensuring that their legacy endures for generations to come.', 'Restored', 1, 1, NULL, '2025-02-23 14:09:20', '2025-03-05 10:35:23'),
(4, 12, 'NCCA Employee ID', 'Lyton', NULL, 'Cong', NULL, '09545565456', 'cong@gmail.com', '2025-02-23', '[\"Fading\",\"Molds\"]', '[\"artifacts-images\\/1740319986-IMG_8228.JPG\"]', 'The restoration of paintings is a vital effort in preserving art, history, and cultural identity. Through careful techniques and dedication, we revive the beauty, colors, and details that time may have faded. This process not only protects the artwork but also ensures that its story and significance continue to inspire future generations.\n\n', '2025-03-08', '[\"test\"]', '[\"artifacts-images\\/1740636596-362124994_1640426053145835_5655626758879896427_n.jpg\"]', 'test', 'Restored', 1, 1, NULL, '2025-02-23 22:13:06', '2025-02-27 14:09:56'),
