INSERT INTO `artifact_exhibits` (`id`, `user_id`, `program_name`, `subject_activity`, `province`, `municipality`, `barangay`, `address`, `start_date`, `end_date`, `description`, `remarks`, `artifacts_id`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'Tourism Month 2025', 'Exhibits Festival', 'Pangasinan', 'Urdaneta', 'Nancayasan', '2nd St, SM City Urdaneta Central, Urdaneta, Pangasinan', '2025-09-22 00:00:00', '2025-09-30 00:00:00', 'The Tourism Month 2025 Exhibits Festival is a grand celebration showcasing the rich cultural heritage, natural wonders, and innovative tourism experiences of various destinations. Set to take place throughout September 2025, this event will feature a diverse range of exhibits highlighting local history, arts and crafts, traditional performances, culinary delights, and eco-tourism initiatives.\n\nVisitors will have the opportunity to explore immersive displays, interact with local artisans, and witness live demonstrations of cultural traditions. The festival will also include tourism forums, networking opportunities, and interactive activities such as virtual reality tours, heritage walks, and storytelling sessions.\n\nWhether you\'re a history enthusiast, an adventure seeker, or a food lover, the Tourism Month 2025 Exhibits Festival promises an unforgettable journey through the heart of diverse cultures and destinations. Join us in celebrating the beauty of travel, the richness of heritage, and the power of tourism in shaping our world!', NULL, '[\"1\",\"2\",\"3\",\"4\",\"5\",\"6\",\"9\"]', 'Approved', '2025-02-22 00:50:59', '2025-02-22 04:14:03'),
(2, 1, 'Tourism Month February 2025', 'Special Exhibit ', 'Pangasinan', 'Urdaneta', 'Nancayasan', 'CB Mall', '2025-02-01 00:00:00', '2025-02-28 00:00:00', 'In celebration of Tourism Month February 2025, a Special Exhibit will be showcased to highlight the rich cultural heritage, history, and natural wonders of our region. This immersive exhibit will feature a stunning collection of artifacts, traditional attire, historical photographs, and interactive displays that tell the story of our vibrant tourism industry.\n\nVisitors can explore:\n✅ Cultural Heritage Displays – Traditional clothing, indigenous crafts, and historical relics.\n✅ Tourism Through Time – A visual journey showcasing the evolution of local tourism.\n✅ Eco-Tourism Showcase – Highlights of breathtaking natural attractions and conservation efforts.\n✅ Gastronomy Corner – A taste of authentic local delicacies and culinary traditions.\n✅ Interactive Booths & Workshops – Hands-on experiences in traditional crafts, music, and dance.\n\nThe Special Exhibit aims to inspire a deeper appreciation for local tourism, encourage sustainable travel, and celebrate the beauty of our destination. Tourists, students, and cultural enthusiasts are invited to witness this extraordinary tribute to our heritage and tourism industry.', 'This exhibit is a testament to the unwavering commitment of our community to preserving and promoting our rich cultural and natural heritage. Through this initiative, we hope to foster a greater sense of pride and responsibility among locals and visitors alike in safeguarding our traditions and environment for future generations. Let us continue to support sustainable tourism and celebrate the unique identity of our homeland!', '[\"1\",\"2\",\"3\",\"5\",\"11\"]', 'Pending', '2025-02-23 11:14:06', '2025-02-23 11:14:06'),
(3, 1, 'test', 'test', 'Pangasinan', 'Dagupan', 'Bacayao Norte', 'test', '2025-03-01 00:00:00', '2025-03-31 00:00:00', 'test', 'test', '[\"1\",\"2\",\"5\",\"10\",\"11\"]', 'Approved', '2025-02-27 14:18:42', '2025-02-27 14:19:04'),
(4, 12, 'Preserving the Past: Museo de Urdaneta Artifacts Exhibit', 'Cultural Artifacts Exhibition & Preservation Awareness', 'Pangasinan', 'Urdaneta', 'Nancayasan', 'SM Urdaneta 3rd Floor', '2025-03-01 00:00:00', '2025-03-31 00:00:00', 'This exhibit showcases historical artifacts from the Museo de Urdaneta collection, highlighting the rich cultural heritage of the region. Visitors will explore artifacts, documents, and preserved items with guided tours, interactive discussions, and workshops on digital archiving and cultural preservation.', 'Open to the public, students, historians, and cultural enthusiasts. Special lectures on preservation techniques and digital archiving will be conducted.', '[\"2\",\"3\",\"5\",\"6\"]', 'Approved', '2025-03-07 15:28:40', '2025-03-07 15:29:45');
