(1, 'Significant Natural Resources', 'Animals (Fauna)', ' ARARAWAN', '[{\"photo_credit\":\"Michael Augie P. Mangaoang\",\"photo_date\":\"2022-05-22\",\"photos\":[\"featured-collections\\/1740153835-67b8a3eb9337e-ARARAWAN1.jpg\",\"featured-collections\\/1740153835-67b8a3eb935fd-ARARAWAN2.jpg\",\"featured-collections\\/1740153835-67b8a3eb936e5-ARARAWAN3.png\",\"featured-collections\\/1740153835-67b8a3eb938db-ARARAWAN4.png\"]}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'A. PHYSICAL FEATURES: \nCricket (ararawan) are grasshopper-like creatures with flattened bodies varying from 3 to 50 mm (0.12 to 2 inches). They have thin cylindrical bodies (1 to 2 inches long maximum), segmented in parts. A rounded head is paired with long slender antennae (feelers). The two forewings are stiff and leathery, and the two long, membranous hind wings are used in flying, covering their abdominal part. At the end of the abdomen, you will find two pointy spikes known as cerci (abdominal sensory appendages). Its strong hind legs that aid them in jumping and flying, along with three-jointed tarsal, are visibly more muscular than those in front. They come in black and light brown colors. \n\nB. COMMON USES: \nConsumed as food by locals in Urdaneta City.\n\nC. OTHER INFORMATION: \nMale crickets produce musical chirping sounds by rubbing a scraper located on one forewing along a row of about 50 to 250 teeth on the opposite forewing. The male scrapes its wings together in stimulation to make its chirping noise. As the two rubs together, comb-like serrations on the wings generate the chirp, a sound magnified by another part of the wing.\nOnly male crickets chirp. They do so to announce their capability to mate. Others also chirp as a celebratory song after having successfully mated. Further, crickets will chirp anywhere – outside or inside – which explains why they can be so annoying if they make it inside your home. Both sexes have susceptible organs on the forelegs for sound reception. There is a direct relationship between cricket chirps and temperature, with the rate increasing with increasing temperature.\nMost female crickets insert eggs into soil or plant stems with their long, slender ovipositors, sometimes causing severe plant damage. The nymphs hatch in the spring and become adults after 6 to 12 molts; adults ordinarily live 6 to 8 weeks.\n', 'Albert Molina, 49 years old from Nancamaliran West, Urdaneta City, narrates that ararawan insects are known for their musical chirping sounds and play a significant role in local myth and superstition. When their chirping echoes in the dead of night, it is equated with good fortune, while harming a cricket supposedly causes misfortune.\n\nArarawan is also considered an exotic food. It comes as a delicacy in the locality. It is not just ordinary food on a poor man’s table, but a specialty served on exceptional occasions. It is also believed that eating ararawan would make a person intelligent.  It is also said that they have compound eyes and great vision. Their eyes enable them to look in different directions simultaneously; that is why those who consume these insects are believed to have clearer eyesight.\nDespite the luck associated with ararawan, farmers would have a different story and experience regarding these leaf- and stem-feeding insects. According to Mr. Sonny Quinto, 58 years old, Farmer from Brgy. Labit Proper Urdaneta City, the ararawan are considered a nuisance to farmers and their crops. They are active at night, and their nymphs are more destructive than adults. They are common in irrigated rice environments. In an upland environment, insects are found underneath heaps of weed piles. At night, adults and nymphs feed on sown seeds and roots of rice plants either in the seedbed or of young seedlings, causing bare patches in the field. In older plants, tillers near the soil surface may be chewed on, but the damage can generally be tolerated. Young and newly planted seedlings are most commonly attacked in the early season before the fields are flooded with water from the irrigation systems.\n', 'Social significance\n\nA few local dishes/snacks with ararawan as the main ingredients are enjoyed by locals of Urdaneta City. At the advent of the rice planting season in the locality, farmers are busy preparing the fields with their carabaos or kuliglig (hand tractors). They can gather ararawan from the upturned/plowed rice field soil. They will then cook it as crunchy adobong ararawan or kinirog nga ararawan (sauteéd mole crickets,) best eaten with steaming rice. It is sometimes shared with the neighborhood. \n\nSocioeconomic significance\n\nThe ararawan is sold in local wet markets, barrios, or neighborhoods during the rainy season. The ararawan is expensive in its raw form. It costs 1 peso per piece of ararawan. \n', 'A. STATUS:\nThe ararawan are not a threatened species. They are still available in the farm fields around Urdaneta City.\nB. CONSTRAINTS/THREATS/ISSUES:\nThe loss, damage, and fragmentation of habitats due to increasing use of chemicals like pesticides and urbanization as increasing rates of fires minimizes and endangers the production of ararawan in the farm fields.\n\nC. CONSERVATION MEASURES:\nHowever, on the local level, there is no conservation done to conserve the ararawan. However, to protect the ararawan insect, the landscape needs to be protected. At a time when land is at a premium for food production, housing and industry, we need to make space for nature. With these, the City Government abides by national laws that implements policies by conserving, protecting, and enhancing our farm fields.\n', 'KEY INFORMANT/S:\nSONNY QUINTO\n58 years old, Farmer\nBrgy. Labit Proper Urdaneta City\n\nALBERT MOLINA\n49 years old, Government Employee\nBrgy. Nancamaliran West, Urdaneta City\n\nHELEN ALAY-AY\n50 years old, Housewife\nBrgy. Nancamaliran East Urdaneta City\n\nLOLITA COMILANG\n79 years old, Housewife\nBrgy. Labit West Urdaneta City\n\nLANI BALBERDI\n59 years old, Vendor\nBrgy. Labit West Urdaneta City\n\nLOU QUINTO\n50 years old, Farmer\nBrgy. Labit West Urdaneta City\n\n\nREFERENCE/S:\nhttps://www.britannica.com/animal/cricket-insect https://www.pestwiki.com/facts-cricket/ stylesatlife.com/articles/bignay-benefits/\nhttp://www.pinoyrice.com/wp-content/uploads/mole-cricket.pdf\nhttp://entnemdept.ufl.edu/creatures/misc/crickets/gryllus.html\n', 'Natalie L. Blanquera\nTessie C. Quinto\n', '2022-05-22', 'Filed cricket, Susuhong (Tagalog), Kamaro (Kapampangan)', 'Genus Gryllidae', NULL, 'Exotic', 'Ararawan live in different habitats such as moist soil, herbs, shrubs, grasses, and vegetation. However, this particular species thrives in oligotrophic, dry, barren habitats. In Urdaneta City, it is mainly seen in farm fields', 'Visible in some barangays', NULL, NULL, NULL, 'Insect , Aranchnid', 'Known for their musical chirping sounds', 'Month of June or July (Rainy Season)', NULL, NULL, NULL, NULL, NULL, 13, NULL, '2025-02-22 00:03:55', '2025-03-08 08:09:21'),
(2, 'Significant Natural Resources', 'Plants (Flora)', 'BUGNAY', '[{\"photo_credit\":\"Michael Augie P. Mangaoang \",\"photo_date\":\"2022-05-22\",\"photos\":[\"featured-collections\\/1740154895-67b8a80fca6dc-BUGNAY1.jpg\",\"featured-collections\\/1740154895-67b8a80fca885-BUGNAY2.jpg\",\"featured-collections\\/1740154895-67b8a80fca95d-BUGNAY3.jpg\",\"featured-collections\\/1740154895-67b8a80fcaa25-BUGNAY4.jpg\"]}]', NULL, NULL, NULL, 'Labit Proper', NULL, NULL, NULL, 'A. MORPHOLOGY\n1. FLOWER: The flowers are small and green. It has a strong, somewhat unpleasant scent. The staminate flowers are arranged in small bunches, and the pistillate flowers grow on long racemes, which will become the long strands of fruit.\n2. LEAVES:   It has large oval-shaped, glossy, leathery, evergreen leaves up to about 20 cm long and 7 cm wide, pointed at the tip, rounded, or pointed at the base.\n3. FRUITING: The fruits are spherical and just under a centimeter wide, hanging singly or paired in long, heavy bunches, borne in grape-like pendant clusters. They are white when immature and gradually turn red, then black.\n4. FRAGRANCE: It has a strong scent.\n5. SPECIAL NOTES: Bugnay is an attractive, undemanding, evergreen, ornamental plant. It is a variable plant that may be short and shrubby or tall and erect, approaching 30 meters in height. It has wide-spreading branches forming a dense crown. \n', 'The bugnay tree is utilized by locals in various ways. The decoction made from the boiled leaves of bugnay is given to individuals (especially children) who are suffering from impatso o kabag (indigestion or flatulence), according to a key informant, Nida Dizon, and a resident of Barangay Catablan Urdaneta City. For those suffering from urinary retention, the decoction must be drunk every day, according to informant Ely Mogan of Barangay Calegu. The fresh leaves of bugnay are also used to treat wounds from dog bites, says Judy Loria of Barangay Catablan. \nThe fruit of bugnay is said to help lose weight, as stated by Adelina Dela Cruz, a resident of Barangay Catablan. Aside from that, it can also be eaten to control high blood pressure.\n', 'Aesthetic Significance\nThe tree has yellow-brown bark. The fruits are tiny berries of oval shape. Fruits are green when unripe, then turn yellow to pink to red and bluish to violet when fully matured or ripened, looking like a tiny grape which adds beauty to the tree. It is smooth and tastes sweet when ripened but very acidic if unripe it tastes sour. As bugnay is a known fruit-bearing tree, it is used as an ornamental plant, and shade tree and is a popular material for local bonsai enthusiasts. It is a robust and easy-to-grow tree. \nSocioeconomic Significance\nThe benefits of the bugnay tree come from its leaves, fruits, and bark which can be made for vinegar, wine, jams, tea, and many more. This can also be sold for different necessities. Also, these are sold in the local market and exported by the local farmers in neighboring cities/municipalities, which became a good source of income for the community. Aside from that, a decoction made from boiling the fruits and leaves is an economical alternative medicine for those suffering from various illnesses such as urinary tract infections, anemia, and hypertension. \n\nScientific Significance\nBugnay, in the form of fruit and leaves, has the potential to keep the levels of blood pressure under control. Thus, it could be consumed by people suffering from hypertension to thwart various hypertension-induced cardiovascular issues. It is also known to offer relief from infections that affect the urinary tract. The tree’s bark yields a strong fiber needed in making rope and cordage. It can also be made into tea, an ideal drink for weight loss. Bugnay tea is known to possess appetite-suppressing properties. Thus, drinking a cup of this tea for half an hour before each meal can help you lose weight in a better way. On the other hand, the leaves of bugnay can be eaten raw or stewed with rice and are also used as a substitute for tomato or vinegar to flavor fish and meat stews. It can also be used to treat snakebites.\n', 'A. STATUS:\nThe bugnay is not a threatened plant species in Urdaneta City.\n\nB. CONSTRAINTS/THREATS/ISSUES: \nPests cause damage to the leaves, stems, and roots of the bugnay tree. Some lay eggs, which then hatch and the larvae burrow more deeply into the wood, blocking off the tree\'s water-conducting tissues. It is also subjected to logging activities and is often converted to making ropes, cordages, fence posts, tool handles, and walking sticks.\n\nC. CONSERVATION MEASURES:\nThe barangay officials encourage the community people to plant bugnay in their backyards through judicious pruning, and adequately fertilized for heavy fruiting. \n', 'KEY INFORMANT/S: \nTESSIE QUINTO\n57 years old, Gov’t Employee\nBrgy. Labit Proper, Urdaneta City\nALODOA CENTRO\n50 years old, Housewife\nBrgy. Catablan Urdaneta City\nKAREN PERATER\n40 years old, Trainer\nBrgy. Oltama Urdaneta City	\nLYN COBERO\n44 years old, Teacher\nBrgy. Cabuloan Urdaneta Cit	\nCRISANTA ABUBO\n34 years old, Housewife\nBrgy.  Catablan Urdaneta City \n\nJOWEL SORIANO\n36 years old, Garbage Collector\nCalegu Urdaneta City\n\nREFERENCE/S:          \n- https://www.stylecraze.com/articles/health-benefits-nutrition-values-of-bignay/#gref\n- https://www.growables.org/information/TropicalFruit/Bignay.htm\n- http://www.stuartxchange.com/Bignay\n', 'Natalie Blanquera\nMarita Basco\n', '2022-05-19', 'WILD BERRY, BIGNAY', 'Antidesma Bunius', 'Tree', 'Native', 'Wet evergreen forest, on river banks, at forest edges, along roadsides; in shady or open habitats', 'Visible in some barangays', 'Annual', '[\"Edibles\",\"Ornamental\",\"Medical\"]', 'The bugnay is also known as Natural Antidote for Snake Bites. Its leaves have been used in alternative medicines to treat snake bites.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 4, NULL, '2025-02-22 00:21:35', '2025-03-02 12:36:36'),
(3, 'Significant Natural Resources', 'Protected Area', 'CATABLAN FARMLAND (DUBAI)', '[{\"photo_credit\":\"Warren D. Novio\",\"photo_date\":\"2022-05-17\",\"photos\":[\"featured-collections\\/1740166908-67b8d6fc7f136-CATABLAN FARMLAND (DUBAI)1.png\",\"featured-collections\\/1740166908-67b8d6fc7f505-CATABLAN FARMLAND (DUBAI)2.jpg\",\"featured-collections\\/1740166908-67b8d6fc7f5d0-CATABLAN FARMLAND (DUBAI)3.jpg\",\"featured-collections\\/1740166908-67b8d6fc7f688-CATABLAN FARMLAND (DUBAI)3.png\"]}]', NULL, NULL, NULL, 'Catablan', NULL, 'Total Brgy. Area: 7,734,000 square meters (773.4 has.)  and SAFDZ of Catablan: 3683000 square meters (368.3 has.)', NULL, 'A.	PHYSICAL FEATURES OF PROTECTED AREA\n\nDubai/Catablan Farmland is a vast agricultural land located in Brgy.Catablan. Brgy bounds the area. Cabaruan and Brgy.Oltama. It has a farm market road with a length of 1.81 kilometers. Some portions of the road have cracks but are still passable. The road is also a drying pavement for palay. There are no built houses in the area, but there are small kubos (nipa hut, a stilt house indigenous to the Philippines) for “pahingahan” or resting area or lounge of farmers. There are small streams/creeks/irrigations passing the farmland where locals can also gather fishes like “paltat” (Scientific Name: Clarias batrachus), tilapia (Scientific Name: Oreochromis niloticus), carpa (Scientific Name: Cyprinus carpio), janitor fish (Scientific Name: Pterygoplichthys), “kiwet” or “rice eel” (Scientific Name: Monopterus albus), “igat” (Scientific Name: Euproctis chrysorrhoea), etc. There are two waiting sheds in the area.\n\nB.	OTHER IMPORTANT DATA: \n\nThe irrigation system in Catablan was constructed in 2007, where 35 hectares are being irrigated. Brgy. Catablan has 59 hectares under the Agrarian Reform Program with 76 beneficiaries/farmers. The SAFDZ of Brgy. Catablan is about 368.3 hectares.\n', 'Delfin M. Dacasin, Sr., Brgy Kagawad, mentioned that the road area was established because of ‘Farm-to- Market-Road’. The road in the middle of the rice fields was established to help the farmers quickly bring their goods to the market. \nMrs. Marife Penuliar, Joy Pagador, and former Barangay Captain Almido Gandia said that the farmland is named after its namesake “Dubai \'\' a country whose landscape is mainly formed of sandy deserts along with gravel-filled desserts; the surrounding areas of the rice field have rough roads, dusty, and dry during the time of the farm to market road construction in the area. \nAnother idea from Joel Penuliar, Mylene Cruz, and Feliciana Caalin, key informants, said that the place is used to call it as ‘Lovers’ Place for Honeymoon Road’ because many young people from the locality and neighboring towns frequent the site and utilize it as a meeting and mating place. \nAccording to former Barangay Secretary of Barangay Catablan Romualdo Benitez, the construction of the farm to market road in Barangay Oltama and Catablan was initiated by former Barangay Captains Almido Gandia and Panandingan Almendarez in 2006 -2007 with an agreement with the landowners of the farmlands in the area. The construction was decided because the transfer of harvested rice was difficult, while some farmers resort to paying porters for 20 pesos per transport. \nThe 8-meter farm-to-market road was conceptualized and begun with the funding assistance of the office of 5th District Representative Mark Cojuangco with a budget of 600 million pesos.  The construction was concluded in 2007.\nThe farm for the market road is currently utilized by farmers and locals living in the area because the pavement is used for rice drying, a shortcut for residents of Barangay Oltama and Lunec Malasiqui.  As the years go by, waiting sheds built in the area are utilized as a local hangout. Delfin Dacasin, however, narrated that if heavy vehicles pass by the site continuously, they might collapse. The canal in the area is so tiny that it causes flooding.  Marlito Serapion, a Barangay Tanod, added that the canal should have been made into a box type to avoid flooding. Catablan Farmland has become a catch basin for water coming from Barangay Cabaruan, Oltama, and Palina West in the past few days.\n', 'Socioeconomic Significance\nSince the farm-to-market road was established, it became a great help to the farmers to bring their goods to the market quickly. This way limits the connection of intermediaries in buying the products and selling them at a high price. This creates a higher income for the farmers. \n\nSocial Significance\nBecause the pavement is used for rice drying, the farm for the market road is now used by farmers and locals residing in the region. It also serves as a shortcut for residents of Barangay Oltama and Lunec Malasiqui. As time passes, the area\'s waiting sheds are used as a neighborhood hangout. Tourists also promenade in the area due to the picturesque scenery.  \n\nSocio-Political Significance\nThe farm-to-market road was constructed due to the cooperation of local farmers and the government (office of Former 5th District Cong. Mark Cojuangco and Barangay officials of Catablan led by former Kap. Almido Gandia former Captain Panandingan Almendarez). Due to this, the transportation of products and goods of locals in the barangays Catablan, Oltama, Lunec, Malasiqui, and Pangasinan to market towns or distribution centers has become more accessible.\n', 'A. STATUS OF PROTECTION: \nConsidered as SAFDZ or Strategic Agricultural and Fisheries Development Zone\n\nB. CONSTRAINTS/THREATS/ISSUES:\nAs of now, there are no constraints and issues in terms of conservation and protection because there is no existing construction/development within the surrounding area. The farm-to-market road is deteriorating due to a lack of road rehabilitation and might collapse. Garbage also clogs the canals of the road, as well as the area being a catch basin, which has been causing recurrent flooding in the area. \n\nC. CONSERVATION MEASURES\nIt is identified as prime agricultural land that should be protected by the Department of Agriculture (DA).  DA declares the place as Farmland Model through Zoning Ordinance of Urdaneta City (Ordinance No.28), Feb.21, 2017. To make the agricultural land more productive, there is an existing construction of “imburnal” for irrigation purposes. The area is maintained as farmland. Conversion of agricultural land to residential/commercial use with more than five hectares is restricted.\n', 'KEY INFORMANT/S: \nFORMER BRGY. CAPTAIN ALMIDO GANDIA\n69 years old, Las Villas Brgy. Catablan, Urdaneta City\n\nDELFIN DACASIN\n62 years old, Brgy. Kagawad\nBrgy. Catablan, Urdaneta City\n\nCAROLINA DACASIN\n62 years old, House wife, Brgy. Catablan, Urdaneta City\n\nMARLITO SERAPION\n60 years old, CVO, Brgy. Catablan, Urdaneta City\n\nROMUALDO BENITEZ\n62 years old, Tricycle Driver\nBrgy. Catablan, Urdaneta City\n', 'Josephine Pariñas \nMae Caldona\nHanan Macaraeg\nMarisyl Cultivo\nMelvin Ellorin\nRoselia Casa\nMary Jane Lovino\nMiko Mamasig\nNovelyn Balagot\nMary Jane Isla\nTonee Agustin\nAsidelio Manibog Jr.\nRicardo Ridao Jr.\nAdelia Pascua\nJeve Mae Rosario\nAlmer Baylon\nNatalie L. Blanquera\n', '2022-05-18', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Protected and Managed Landscape / Seascape', NULL, NULL, 'NIPAS (National Integrated Protected Areas System, RA7586)', NULL, NULL, NULL, NULL, 6, NULL, '2025-02-22 03:41:48', '2025-02-24 14:11:28');
