(1, 'Tangible-Immovable Cultural Heritage', 'School Institutions', 'MANAN ELEMENTARY SCHOOL', '[{\"photo_credit\":\"Ms. Brenda Mae Tolentino\",\"photo_date\":\"2022-05-15\",\"photos\":[\"featured-collections\\/1740199542-67b95676d4f59-MANAN ELEMENTARY SCHOOL1.jpg\",\"featured-collections\\/1740199542-67b95676d5166-MANAN ELEMENTARY SCHOOL2.jpg\",\"featured-collections\\/1740199542-67b95676d5251-MANAN ELEMENTARY SCHOOL3.jpg\",\"featured-collections\\/1740199542-67b95676d52eb-MANAN ELEMENTARY SCHOOL4.jpg\"]}]', 'Urdaneta Cityh', 'Pangasinan', NULL, 'Both Non-Formal & Formal Education', 'cultural-lists/1740199542-MANAN ELEMENTARY SCHOOL5.png', 'MANAN ELEMENTARY SCHOOL OFFCIAL SEAL\n1953 – The year when the school was established \nDepEd, K12 – is the program that covers Kindergarten to grade 12 years of basic education of the Department of education which Manan Elementary School embraces \nDepEd Torch – Symbolizes the vision in providing light to learners \nTwo interconnected squares – represents the interrelationship and connections of the Department of Education and MANAN Elementary School with the community, learners, parents and all other stakeholders of this institution with strength, efficiency, and professionalism. Also represents stability and reliability of the department and institution.\n', 'History\nManan Elementary School is an institution that has significant role in achieving him community’s stability, program and prosperity.\nThe first classes were held in one classroom made of “sawali” walls and coconut leaves piled together to serve as a temporary roof against the sun and rain. The teacher and learners ran to the nearest houses when it rained. The “sawali” classroom stood in the small parcel of land owned by Don Pablo M. Locquiao measuring 3,776.5 sq. m. located at Zone 5 Mabanogbg, with the Macalong River in southern part. It is 1.5 km away from the city proper. It was name Ma-Nan Community School for the reason that the learners and Stakeholders were from the barangays of Mabanogbog and Nancamaliran.\nIt started with one class only, the grade three class, with about fifty learners who were transferred or pulled out from their original school, Urdaneta I Central School/ they were the residents of Mabanogbog and Nancamaliran East is a neighbor barangay. This is to encourage the parents to enroll their children since they don’t need to go far schools to study.\nAccording to Mr. Pedro C. Israel, a former head teacher of Manan Elementary School, the first administrators of the school are the Manzano’s. The school was first headed by Mr. Artemio Manzano followed by Dominador Manzano.\nThe very first teacher of the school was Mr. Eugenio Manzano who was noted for being patient, persevering and hardworking.\nThere was no graduation rite then because it held only a grade three class but they also their closing programs. The parents of the honor pupils donated chickens to the school which were sold to raise fund for the school improvement. Through the Parent Teachers Association (PTA) meetings and cooperation they were able to secure more fund for the school. The first PTA president was Mr. Federico Laguerder who was followed by Don Pablo Locquiao whose sacrifices and love for the school were truly remarkable.\nThe first Closing and Commencement Exercises was conducted in 1953 and this significant school rite has been one of the programs and celebration that mark the school since then\n\nORGANIZATIONAL STRUCTURE OF MANAN ELEMENTARY SCHOOL\n\nFATIMA R. BOADO, CESO VI\nSchools Division Superintendent\nDr. RUSSEL JIM V. TAMAYO\nAssisstant Schools Division Superintendent\nDr. JUAN P. CATALAN\nPublic Schools District Supervisor Cluster 7\nDENIA R. GACIA\nPrincipal IV\nKindergarten Teacher	Grade 1 Teachers	Grade 2 Teachers	Grade 3 Teachers	Grade 4 Teachers	Grade 5 Teachers	Grade 6 Teachers	Relieving Teacher\nAILENE G. BERNARDIO\nTeacher 2	RUDELYN\nM. JAVAR\nTeacher 3	RODEL N. NAIPES\nTeacher 3	MARR LEO\nU. SOREL\nTeacher 3	BLESSIE L. DAGURO\nTeacher 2	ARLENE A. DELA ROSA Teacher 3	HELEN A. MADAYAG Teacher 3	MELVIN L. MAMASIG Teacher 3\n	MARILOU\nC. VEGA\nTeacher 3	VIOLETA A. MANUEL Teacher 3	MARIFLOR\nM. BRAVO\nTeacher 3	DAISY A. PANOY Teacher 1	\n. \nCONTACT DETAILS\nHELEN A. MADAYAG\nTeacher III\nContact Number: 0917-1431-978\nEmail: 102301@deped.gov.ph\n\n\nDESCRIPTION OF SIGNIFICANT MILESTONES:\nMANAN Elementary School started with classes from grade 1 to grade 4 only. Gradually added grade levels every school year and increased number of enrolments from barangay Mabanogbog, San Vicente and Nancamaliran East. \nThe small parcel of land became larger and longer, it was almost doubled. The parcel of land measuring 3,776.25 sq. m. had been bought as the school site from Don Pablo M. Locquiao by the municipality of Urdaneta on September 11, 1953. Later, another parcel of land situated at the eastern adjacent part of the former lot measuring 1,323.25 sq. m was donated by Feliciano Figuration on May 22, 1961. As a whole, Manan Elementary School now measures 5,008.50 sq. m. It is registered in the name of City Government of Urdaneta.\nThey started with makeshift with coconut leaves for the roofing of classrooms and and used spaces under the house of prominent people of barangay Mabanogbog. As years passed, single-storey concrete classrooms were provided. In the previous years, it was improved to two-storey buildings. \nAt present, MANAN Elementary school have three two-storey buildings for classrooms, one new building with two classrooms with one toilet each. Marcos-type building is still present and being used for anciliary rooms such as: Guidance Room, mini-library/LRMDS, School clinic and canteen. It also has its computer room. In the previous years the teachers were using typewriter in accomplishing their reports. At present, the school have computers used for teaching and administrative purpose. It also has photocopy machine and all teachers were provided with printers for their learning materials and reports in school year 2020-2021.\nProminent individuals who graduated from MANAN Elementary School include but are not limited to the following:\nMR. DANILO A. CORPUZ, born on December 24, 1953, graduated in 1966 as valedictorian. He is now a license nurse in Chicago, USA.\nMrs. VIRGINIA B. RIMANDO graduated in 1973. She is a retired public-school teacher who served in MANAN Elementary School. She served the children of MANAN Elementary School with a very warm and large heart.\nMr. MELVIN L. MAMASIG, born May 30, 1976, graduated in 1988. He is now a DepEd Employee, 20 years in service, Teacher 3. He is previously teaching at Don Antonio Bongolan National High School. He requested and granted to be transferred in MANAN Elementary School to further serve his Alma Mater. He initiated improvement in school ground lighting through soliciting to prominent people.\nMr. JOSEPH T. GARCIA, born on December 17, 1977, graduated in 1990 as valedictorian. He is now Licensed Engineer/contractor. Mr. ROGELIO L. CABOTAJE JR., born on September 12, 1979, graduated in 1992 as Valedictorian, is a Licensed Nurse in Texas, USA.\nTeachers and learners have been active in joining district and division contests and other events. In the past years, they had been winning in different sports and academic competitions\nBelow are some of the winnings garnered by the school, teachers and learners: School Awards and Recognitions* (School Category) Tulungan sa Purok \n3rd Place –Tulungan sa Purok 2018 City of Urdaneta \n1st Place – Tulungan sa Purok 2017 City of Urdaneta\n1st Place – Tulungan sa Purok 2016 City of Urdaneta\n1st Place – Tulungan sa Purok 2015 City of Urdaneta \n5th Place – Tulungan sa Purok 2014 City of Urdaneta Brigada Eskwela 2014 Medium category\n4th Place – Brigada Eskwela 2017 Medium School category\n5th Place YES-O Science Quest – Division Level: \n1st Place – Cleanest Camp 2019 \n1st Place – Cleanest Camp 2018 Advisers: Arlene A. Dela Rosa (Science Coordinator) Blessie L. Daguro, Helen A. Madayag (YES-O Advisers) (Teachers’ Category) Science Quest \n\n', 'Ms. Rudelyn M. Javar, is an alumni of MANAN Elementary School batch 1994. She works as a DepEd Employee for 15 years. She is currently teaching in MANAN Elementary School as a grade 1 teacher. She has been very devoted to her profession in the past years which shows to her outstanding records of works. Due to the COVID-19 pandemic, she advocates teaching at home for her grade 1 learners.\nMrs. Yolanda F. Calacsan, an alumni of MANAN Elementary School, is a Registered Nurse. She is currently serving as a Barangay Secretary in barangay Mabanogbog. She also served as PTA President in the MANAN Elementary School for several years which contributed to school accomplishments and improvement. At present, she is elected as School Governing Council Chairperson of MANAN Elementary School.\nOther prominent people of MANAN Elementary School are Mr. Eusebio Guloy Jr. is now a retired Marine; Mr. Ronaldo M. Alimorong, 61 years old, is a registered Mechanical Engineer and Mrs. Felisa L. Padilla, a retired public elementary school teacher.\n', 'Social Significance\nTo nurture learners, support teachers and community, the MANAN Elementary School Faculty and learners in collaboration with the School Pupil Government (SPG), Federated Parent-Teacher Association (FPTA), School Governing Council (SGC) and Barangay Mabanogbog Council, several Projects, Programs and Activities (PPA’s) are observed and implemented. The following PPAs are as follows but not limited to: (1) Numeracy Program: Project Zero-Non Numerates, Project SOLVE focuses on the monitoring and improving learners skills and ability in numeracy. This program involves mathematical situations. \n(2) Literacy Programs and Activities like Phil-IRI, I ReACt, and FLAT, all of which involves monitoring, evaluating and improving skills and abilities of learners in reading and comprehension (3) Tulungan sa Purok (TsP) – the school and every zone of barangay Mabanogbog are encourage to plant vegetable in their area for future consumption. The school vegetable garden is used as additional supply for school feeding program. Some of the vegetables were cooked in the school during the normal face to face set-up. Some harvested products were being sold and some were given to teachers and learners as a home supply. (4) School Feeding Program (SBFP) – School Personnel conduct feeding program for learners who were evaluated as “wasted or severely wasted and stunted’ other known as “malnourished” children. DepEd provides fund for their food, Donations from stakeholders and products from Gulayan sa Paaralan Program (GPP) as used as source. \n(5) Gulayan Sa Paaralan (GPP) – it boosts the awareness of learners and community on the importance of planting vegetables in the community. Plants in the school vegetable garden were taken care of by teachers, learners and parents/guardians. Since pandemic, the learners together with their parents applies and observes this advocacy at home where they are encouraged to plant on recycled pots, if vacant lot or space is a challenge. (6) Brigada Eskwela – Every year before classes will open, stakeholders of the institution conduct a “Bayanihan” a weeklong preparation by cleaning, gardening, repairing, painting and repainting. The activities are done collaboratively by teachers, learners, parents, guardians and other stakeholders such as NGOs, LGUs, Alumni, Religious Affilations and private group and individuals. (7) Every year, the institution also conducts different activities such as: Commemoration of National Independence Day, Nutrition Month, Buwan ng Wika, Teachers Month/World Teachers Day, School Intramurals, Christmas Program, Early Enrolment, Commemoration of EDSA People Power Revolution, Valentines Program or Children’s Festival and Commencement Exercises.\nSocio-economic Significance\nIn the previous years, the institution offers Alternative Learning System (ALS) program where learners are guided for improving their skills. During their EPP/TLE class, learners learned how to cook, prepare deserts and snacks, recycled materials, propagate plants and run a small business which they are applying basically in their daily living.\n\nV. ASSESSMENT OF THE INSTITUTION\nA. CONDITION/STATUS OF THE INSTITUTION\n Manan Elementary School is currently embracing blended learning as modality of teaching and learning process. As part of Basic Education Learning Continuity Plan (BELCP) learners are in different modalities depending on their status wherein there are learners who can afford to attend virtual/online class in addition to Modular Distance Learning. On the other hand, learners who have no gadgets and internet accessibility use plain printed modules. Teachers prepare Weekly Home Learning Plan (WHLP) instead of the usual Daily Lesson Plan/Daily Lesson Log. Teachers report in school two times a week depending on their Skeletal Work Schedule to distribute and retrieve modules. They Work from Home (WFH) for three to four day including Saturdays.\n\nB. CONSTRAINTS/ THREATS/ ISSUES/ CHALLENGES: \nEveryone is experiencing total adjustments since the COVID-19 Pandemic. Struggles are everywhere not only to parents but for teachers as well and specially to learners. Teachers are having difficulties in achieving the Most Essential Learning Competencies (MELCs) prescribed by the DepEd due to the current situation. Communication is very limited. Contact to learners is very insufficient making the delivery of learning ineffective. There is no guarantee that the learners are effective learning specially those who are on printed modular set up alone. Parents keep on complaining that their children are not listening to them and always request for a face to face set up. some parents do not follow their schedules of going to school during distribution and retrieval of modules due to the nature of their work. Some learners are being neglected at home but can’t do anything but to wait for their parents to give what they need to do for their studies. Some learners are seen around the school premises because there are no parents beside them to guide. Teachers are loaded with work related reports and activities.\n.\nC. MEASURES AND DESCRIPTION OF SAFEGUARDING MEASURES TAKEN:  \nSafety protocols from IATF are being followed in the school. Signages are posted around the school to remind school goers about the safety protocol. Teachers and parents are allowed to come to school only during their schedules of distribution and retrieval of modules. School goers and visitors are instructed strictly to come wearing facemask, sanitized before entering the school or the room, log-in for contact tracing, follow entrance and exit path. No children below 15 years old are allowed to come to school. Emergency hotlines are also posted inside and outside classrooms.\n', '[\"Print, write-ups\",\"Photographs and sketches\"]', 'HELEN A. MADAYAG\n44 years old, Teacher III\nBrgy. Nancamaliran East, Urdaneta City\n\nRUDELYN M. JAVAR\n41 years old, Teacher III\nBrgy. Mabanogbog, Urdaneta City\n\nMARILOU C. VEGA\n47 years old, Teacher III\nBrgy. San Vicente Centro, Urdaneta City\n\nDAISY A. PANOY\n24 years old, Teacher I\nBrgy. Sta. Lucia, Urdaneta City\n\nMARR LEO U. SOREL\n28 years old, Teacher III\nBrgy. San Vicente West, Urdaneta City\n\nREFERENCE/S: \nCompilation of Urdaneta City School Histories (Manan Elementary School) Writers/ Researchers: Arlene A. Dela Rosa, Marr Leo U. Sorel, Helen A. Madayag\n', 'Rejoice Ann Ignacio\nKyle Obra\nCharisse Consolacion\nGiena Mae Lagmay\nOfelia O. Cabebe\nRoneil E. Olinares\nNatalie L. Blanquera\n', '2022-05-09', NULL, NULL, NULL, 5, NULL, '2025-02-22 12:45:42', '2025-03-07 22:20:35');
