INSERT INTO `intangible_cultural_heritages` (`id`, `cultural_heritage_category`, `cultural_heritage_type`, `name`, `photo_details`, `type`, `geographical_location`, `related_domains`, `summary_of_elements`, `list_of_tangible_movable_heritage`, `list_of_flora_fauna`, `stories`, `significance`, `assessment_of_practice`, `measures_and_description_dropdown`, `measures_and_description_text`, `supporting_documentation`, `key_informat`, `mappers`, `date_profiled`, `attachment_text`, `attachment_image`, `views`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Intangible Cultural Heritage', 'Social Practices', 'DUNG-AW', '[{\"photo_credit\":\"Jaydee S. Dela Cruz \",\"photo_date\":\"2022-05-22\",\"photos\":[\"featured-collections\\/1741391303-67cb85c7a4b9c-DUNG-AW1.jpg\",\"featured-collections\\/1741391303-67cb85c7a4f54-DUNG-AW2.png\",\"featured-collections\\/1741391303-67cb85c7a50a9-DUNG-AW3.jpg\",\"featured-collections\\/1741391303-67cb85c7a5748-DUNG-AW4.jpg\"]}]', 'Birth, Wedding, Funeral Rituals', 'It is done during a funeral wake in the house or chapel. The practitioner should stand beside the coffin as he does dung-aw.', 'Oral traditions and expressions', 'A.	Summary of the element\n“Dung-Aw” is a tradition of Ilocanos and is practiced in the City. It is a poem of lamentation delivered to the chosen remains of a child, spouse, or parents. This is a word from “Iluko” meaning “weeping”. It is believed that “Dung-aw” helps in releasing grief and this gives them relief.\n\nDung-aw is done by standing by the coffin and looking inside it. The practitioner then proceeds to chant while crying. “Dung-Aw” starts with a soft cry of the family until it gets to a higher volume. It expresses grief and remembers the life and death of the loved one.\n\n\nB.	Culture-bearer/s and practitioner/s of the element\nAs part of the Ilocano culture and tradition, the belief is practiced which serves as a pride of a well-preserved culture of Ilocanos. This belief is practiced by elders in the City.\nAnyone can do Dung-Aw, whether it is a male or a female. It usually starts with one person. Once it starts, other people would follow in doing dung-aw. \n\n\nC.	Mode of transmission\nThe practice is passed through continuous observance via oral transmission and observation. It is transmitted through constant and consistent practice and observed by other people in the community/ future practitioners. The belief is practiced until now, for it has been passed down to all generations by the respected Ilocano elders.', '[]', '[{\"name_2\":\"Flower\",\"photo_2\":\"cultural-lists\\/1741391303-DUNG-AW5.jpg\",\"use_2\":\"They give these at the dead\\u2019s wake as a guide to the afterlife. \"}]', 'Shella De Vera, 63 years old from Barangay Camantiles narrates that the dung-aw is done to lighten the heavy feeling of sadness by the grieving family members after the death of a relative. Through the dung-aw, the family members can ask for forgiveness for their misgivings or sins to the deceased through tears and poetry so that the soul of the deceased will be able to reach the afterlife. \nAngelita Cansino, 80 years old and a resident of Barangay Nancalobasaan, stated that they conduct the dung-aw to the deceased in the family’s stead so that the soul will feel the love of those who are still alive.  Some rich families also hire funeral mourners to perform dung-aw.\n', 'Social Significance\nDung-aw is a dirge or lament that portrays sorrow and pain in which the mourner expresses his/her sadness and remembers the life and death of a loved one, which traditionally contains poetry but is most often extemporized. This practice of commemorating life is still practiced in the locality. It only signifies the unique ethnicity of Ilocanos and its well-preserved customs. Practicing dung-aw helps release the feelings of a person in grief, this gives relief to their pain.\nDung-Aw is also but rarely chanted at Pasiyam (9th day), 40 days, and the Death Anniversary of the deceased. The said element is being practiced to also ask for forgiveness from the deceased, this serves as an emotional outlet and coping mechanism for the grieving families.\n\nSocioeconomic Significance\nSome people do this as their side job. They can be hired to perform dung-aw during the funeral wake. The effect of dung-aw is electric and people are moved to tears.', 'A. CONDITION/STATUS OF THE PRACTICE\nDung-aw is still used and practiced today.\n\n\nB. CONSTRAINTS/ THREATS/ ISSUES/ CHALLENGES:\nYounger generations are living in a cultural divide where modern ideologies dismiss or even frown upon these ethnological narratives and beliefs such as doing dung-aw. Only old folks are doing and interested in doing this belief. \n', 'Transmission, particularly through non-formal education', 'Description of Safeguarding Measures Taken:\n\nThe practice is passed through continuous observance via oral transmission and observation. It is transmitted through constant and consistent practice and observed by other people in the community/ future practitioners.\n', '[\"Audio\\/video recording\",\"Photographs and sketches\",\"Music notations\"]', '\nSHELLA DE VERA \n63 years old, Housewife\nBrgy. Camantiles Urdaneta City Pangasinan\n\nANGELITA CANSINO\n80 years old, Housewife\nBrgy. Nancalobasaan Urdaneta City Pangasinan\n\nREFERENCE/S AND OTHER RESOURCES:\nhttp://filipino-folk-songs.blogspot.com/2012/02/dung-aw-lyrics-ilocano-songs.html', 'Rejoice Ann L. Ignacio\nJovylyn C. Bergado\nNatalie L.  Blanquera\n', '2021-05-21', 'DUNG-AW\n\nAy ama nga nageb-ebba\nDinak man kaasian aya\nA panawan a sisina\nTay uneg balay a kasa.\n', 'attachment-images/1741391303-DUNG-AW6.jpg', 0, NULL, '2025-03-08 07:48:23', '2025-03-08 07:48:23');
