INSERT INTO `significant_personalities` (`id`, `cultural_heritage_category`, `cultural_heritage_type`, `name`, `photo_details`, `date_of_birth`, `date_of_death`, `age`, `prominence`, `birthplace`, `present_address`, `biography`, `significance`, `references`, `mapper`, `date_profiled`, `attachment`, `views`, `created_at`, `updated_at`) VALUES
(2, 'Significant Personalities', 'NA', 'DR. PEDRO T. ORATA', '[{\"photo_credit\":\"Dr. Teofidez E. Calvero\",\"photo_date\":\"1994-07-10\",\"photos\":[\"featured-collections\\/1741391991-67cb887715cf2-DR. PEDRO T. ORATA1.jpg\",\"featured-collections\\/1741391991-67cb8877164d9-DR. PEDRO T. ORATA2.png\"]}]', '1899-02-27', '1989-07-13', 90, 'Education', 'Bactad, Urdaneta City', 'N/A', '     He was born in a very remote sitio called Bañgar (named after a tree) – now part of the Supotima – of Bactad Urdaneta, Pangasinan, on 27 February 1899. His parents are Ilocano immigrants in Pangasinan. His father, Candido Arata came from Tubao, La Union, whereas his mother – Numeriana Tamesis-Arata was born in Cabugao, Ilocos Sur. He has a sister named Victoriana and two brothers, one of them is older than him and the other is the youngest, both of whom died young. His father died when he was twenty years old and just starting his studies in America. He was married to Pilar Ramos, but without children.\nMy Life and Work: Rough Sailing All The Way by Dr. Pedro T. Orata (August 28, 1972)\n\nThe change of his family name’s spelling, “Arata” to “Orata” was an arrangement he made to relieve a childhood unease. The record of his baptism shows that his family name begins with A – Arata. He changed it first to Urata and then to Orata because he did not want to be among the first on the list and to sit in the front row. During his time, his teachers used to call pupils to recite in alphabetical order. He was always among the first to be called, and he was scared. Since his name was listed towards the end of the register, he had more time to prepare, and besides, very often the bell rang before his name was reached. However, he did not want to be left out entirely, either, he changed U to O, which placed him above the middle of the list.\nAs a boy, he had to work, very hard. From his home on a small farm, where they had an old carabao, he sold vegetables, shells, and fish, carrying the same in a winnowing basket on his head and walking over rice paddies several kilometers to the center of the barrio. At first, he was not interested in school. The fact he had to repeat Grade IV because he barely passed the third grade. Because of their failure, his father put him to work on the farm. Despite this setback, Pedro persevered. He enrolled again in Grade IV and passed. The following year he had to go to Binalonan, the next town, to attend class in Grade V. There were three of them from the barrio of Bactad. The following year the intermediate grades, Grade V and VI first, and then Grade VII the year after, were opened in Urdaneta, he continued his schooling there, where he finished his elementary course in 1916\nAfter completing Grade VI, he went to Los Banos to enroll and the new College of Agriculture. He felt very homesick and, besides, he failed the course in Botany. He returned home and decided to go to high school in Lingayen, the capital of the province of Pangasinan, after completing Grade VII in Urdaneta. His sister volunteered to help him continue in high school in Lingayen. They had to walk 50 kilometers from Lingayen and back again to Bactad many times during the four years, 1916 – 1920.\nUpon graduation in 1920 as valedictorian of his high school class in Lingayen, his sister’s savings allowed him to travel to the United States. In college, in the United States, for seven years, he worked eight to ten hours a day, to get his BSE, MS, (University of Illinois), and Ph. D. (Ohio State University) degrees. Working on a railroad gang, washing dishes, and finally with partial pensionado support from the Philippine government, he earned his Ph.D. in 1927 and come home to join the Bureau of Public Schools.\nReturning to the Philippines in 1927, he taught in the Bayambang Normal School for one semester, then for a year at the Philippine Normal School, now College, after which he was assigned to the General Office of the Bureau of Education as Assistant Chief of the Research and Measurements Section. In 1929, he was assigned as Division Superintendent of Schools in Isabela, the youngest to assume that post before and since, without any experience as principal or supervisor. He was subsequently transferred to Sorsogon where he stayed for three years.\nIn 1934, he returned to the United States to accept a position as a member of the faculty of his Alma Mater, the Ohio State University, where he stayed for two years, when he was called to head and establish the first community school (kindergarten to third-year high school) in the United States, in an Indian Reservation in Kyle, South Dakota.\nIn 1937, he was called to join the staff of the U.S. Office of Education (then the equivalent of a Department of Education in America) first as a specialist in home economics (being the only man among a dozen women), and later as a special consultant of the Occupational Information and Guidance Service of the same office.\nIn 1941, he was asked by Dr. Camilo Osias to join his office – the National Council of Education. For a while, he was Chief of the Curriculum Division of the then Department of Information and Education. In 1947, he was designated as head of a group of Filipino educators to serve as technical staff of the Joint Congressional Committee on Education whose report and recommendations served as bases for the reorganization of the educational system that was to follow around 1950. \nAfter the war, in 1948, he joined UNESCO first to make a survey of education in Thailand together with an English educator, and then as a program specialist in education in Paris where his wife and he stayed until 1960 when he returned to the Philippines as Dean of the Graduate School of the Philippine Normal College. When he retired in 1964, he was invited to spend ten months at the East-West Center in Hawaii as a senior specialist, returning home in 1965 to assume the position of Educational Consultant of the Dagupan Colleges. Since then, he has been appointed Special Consultant of the Secretary of Education “without compensation”, a position which he still holds.\nHe has written a dozen books and some 100 articles in the fields of education, psychology, philosophy, and allied subjects. His name is included in WHOS’ WHO IN AMERICAN EDUCATION, LEADERS (US) IN EDUCATION, and PHILIPPINES WHO’S WHO. He received the PRO PATRIA AWARD in 1956. Listed in INTERCONTINENTAL BIOGRAPHICAL ASSOCIATION, 1972; INTERNATIONAL WHO’S WHO IN COMMUNITY SERVICE, 1971; THE TWO THOUSAND MEN OF ACHIEVEMENT IN 1970 and 1971 (the last three published in London, England).\nIn 1964, he started a series of self-supporting educational innovations: He founded the barrio high school movement in 1964 – the first of their kind, having been authorized to operate experimentally for one year. He gathered all the “degreed” people – doctors, engineers, pharmacists, lawyers, dentists, etc. and opened a high school in the old church which was bombed during the war. It had no roof. There were no chairs nor desks, no books, no paper nor pencils. There were only students and teachers – three hundred fifty students and some fifteen instructors. \nIn 1966, Dr. Orata founded the Urdaneta Community College, now known as the Urdaneta City University, one of the country’s first community colleges, which is housed in the Urdaneta Community High School, preschool in 1969, and multigrade schools in 1971. He served as its president up to his death in 1989 without receiving his salary and allowance, opting to have these given to students who had difficulty financing their studies.\nWithout extra cost to the government, and with an aggregate enrollment in 1971 of nearly 1/3 million children and youth, for which he was given in 1971 the MAGSAYSAY AWARD FOR PUBLIC SERVICE. His award of $10,000 has been deposited in a bank as a trust fund the annual income of which, amounting to ₱ 9,000, will be used to help needy students in their effort to earn their school experiences.\nIn the annals of Philippine public service, probably no other Filipino, living or dead, can lay claim to a more far-reaching influence on Philippine education and society than Dr. Pedro T. Orata. Single-handedly, he tackled formidable problems in Philippine education, using unorthodox methods that were then considered inapplicable to Philippine conditions and the nation’s social temperament, complicated further by age-old Filipino reliance and dependence on the government for almost every public concern and function.\nThe boy who walked kilometers across rice paddies to attend classes, who failed in his classes but later emerged as an honor student, who changed his last name just so he would not be called on to recite first in class but who became an authority on educational innovations, who worked for hours to support his schooling, would now be known for his contributions in Philippine education.\n', 'Historical significance\nDr. Pedro T. Orata was the father of Barangay High Schools in the Philippines and had his persistent labors and exceptional concern for the out-of-school youths in their educational needs of the people in the community. He occupied important positions in the Education sector, in the Philippines and the US. Orata exemplified the model of a contemporary hero who dedicated his life to serving his people.\nSocial significance\nHe was awarded an Outstanding leadership award for his dedication to public service and his invaluable efforts in the field of education that sets an example to the youths today. The first community college in the Philippines, Urdaneta City University (UCU) founded in 1966, formerly known as City Colleges of Urdaneta (CCU) and Urdaneta Community College (UCC) was Dr. Orata’s expression of his great love, faith, and concern for the poor yet capable and deserving Filipino youth who cannot afford collegiate schooling in the cities.\nSocio-economic significance\nOrata’s unfailing dedication to building multiple schools in barrios allowed the literacy rate of Pangasinan communities to have a modest increase over the decades. To this day, the majority of students who studied and learned from Orata’s projects made a significant contribution to the province’s development and Urdaneta’s transition to a model city\n', 'JOSIE B. TACAD\n59 years old, Master Teacher I (PTONHS)\nBrgy. Pedro T. Orata, Urdaneta City\n \nCHARITO L. ENGUITO\n78 years old, Retired Teacher\nBrgy. Pedro T. Orata, Urdaneta City\n \nMINDA PAGADOR TOMINES\n50 years old, Housekeeper\nBrgy. Pedro T. Orata, Urdaneta City\n \nJOSE ARNEL L. ENGUITO\n58 years old, Assistant Manager (Bar)\nHonolulu Hawaii\n\nNIEL G. TABLADA\n50 years old, Brgy. Captain of P.T. Orata\nBrgy. Pedro T. Orata, Urdaneta City\n\n\nREFERENCE/S AND OTHER RESOURCES:	\n\n- LIFE & WORKS OF DR. PEDRO T. ORATA\n - MY LIFE AND WORK: ROUGH SAILING ALL THE WAY by Dr. Pedro T. Orata (August 28, 1972)\n - PEDRO T. ORATA: HIS LEGACIES TO PHILIPPINE EDUCATION AND SOCIETY by Dr. Teofidez E. Calvero\n - https://www.rmaward.asia/awardees/orata-pedro-tamesis/\n - https://ucu.edu.ph/dr-pedro-t-orata\n', 'Natalie L. Blanquera\nIrene L. Parengit\n', '2019-11-06', '\"ATTACHMENTS:\\n\\n1. List of works and achievements\\n\\u25cf\\tFounder of Urdaneta Community High School (first self-supporting municipal high school), 1945\\n\\u25cf\\tFounder of barrio high school movement, 1964\\n\\u25cf\\tFounder of community college movement, starting with Urdaneta Community College (1st self-supporting community college, 1966\\n\\u25cf\\tOriginator and promoter of practicum approach in educational leadership, guidance and counseling, social studies (for better citizenship), and science (as a way of life for a better living), 1960\\n\\u25cf\\tFounder of barrio preschool movement (1969) and multigrade schools (1971)\\n\\u25cf\\tInitiator of Teaching Science as a Way of Life for Better Living (Practical and Ethical)\\n\\u25cf\\tMAGSAYSAY AWARD FOR PUBLIC SERVICE (1971)\\n\\n2. References and other resources\\n\\u25cf\\tSELF\\u2013HELPLP BARRIO HIGH SCHOOLS: THE STORY OF 250,000 STUDENTS EARNING THEIR EDUCATION\\nPedro T. Orata, 1972\\n\\n\\u25cf\\tPEDRO T. ORATA: HIS LEGACIES TO PHILIPPINE EDUCATION AND SOCIETY \\nTeofidez E. Calvero, 1994\\n\"', 1, '2025-03-08 07:59:51', '2025-03-08 07:59:56');
