(1, 'Tangible-Immovable Cultural Heritage', 'Government/Private', 'Old City Hall of Urdaneta', '[{\"photo_credit\":\"Warren D. Novio\",\"photo_date\":\"2022-03-17\",\"photos\":[\"featured-collections\\/1740167507-67b8d953356ad-Old City Hall of Urdaneta1.jpg\",\"featured-collections\\/1740167507-67b8d953358f1-Old City Hall of Urdaneta2.jpg\"]},{\"photo_credit\":\"Gerome Agas\",\"photo_date\":\"2022-02-17\",\"photos\":[\"featured-collections\\/1740167507-67b8d95335a05-Old City Hall of Urdaneta3.jpg\",\"featured-collections\\/1740167507-67b8d95335ad9-Old City Hall of Urdaneta4.jpg\",\"featured-collections\\/1740167507-67b8d95335b99-Old City Hall of Urdaneta5.jpg\",\"featured-collections\\/1740167507-67b8d95335c53-Old City Hall of Urdaneta6.jpg\"]}]', 'Municipal / City Hall', 'Public', 'Poblacion', NULL, '1558338', '12034018', '1915 / 1920', '6,587 m2 (R1)', '633.2725m2', '105 year', 'Public/City Government of Urdaneta', 'REPUBLIC ACT NO. 10066 - An act providing for the protection and conservation of the national cultural heritage, strengthening the National Commission for Culture and the Arts (NCCA) and its affiliated cultural agencies, and for other purposes.', 'A. Physical Description \nThe Old City Hall is located at the heart of the city adjacent to different commercial and institutional establishments. It has a total area of 6,587 square meter. The city hall is a two-story building: its first floor is where the public information, legal office, City Civil Registry, City Treasurer’s Office and Real Property Tax Division are located while the second floor is where the AVR, City Administrator’s Office and City Mayor’s Office are located. The first floor has separate comfort rooms for men and women located at the back while the comfort room at the second floor is located in front of the City Administrator’s office.\nEvery office is classy yet simple and organized. It is made of cement wherein its windows are made of tempered glass windows and glass doors in aluminum frame to allow people to see inside and outside. The flooring is made of porcelain tiles. The stair going to the second floor is made of yakal wood.\nThe Old City Hall of Urdaneta’s columns were based on Greek architectural design. Its four columns on its facade feature Doric-style columns while the other columns are Corinthian style. The roof of the structure is made from fully metal shingles roof wherein its ceiling is made of cement. It is well-structured with a taste of elegance and modernization. Its façade reflects the old Spanish style of building structures that makes it attractive and manifests grandeur effect. Outside is a landscape consisting of an old Mabolo tree with a nicely trimmed variety of ornamental plants. \nAs the years passed by, the city hall was upgraded and renovated to accommodate the needs of the constituents of the city and for more convenient transactions.\n\nB. History of the Structure \nThe “Municipal Building” was erected in 1915 under the administration of Municipal President Hermenigildo Alonso to serve as the seat of local governments in Urdaneta.\nMr. Isidro Ramos wrote on the Children Summer Festival Souvenir Program in 1958. The destruction brought to the Philippines by the last war tremendously altered the structure of the building.  The town of Urdaneta witnessed two battles. The first was the Japanese Invasion and the second and the worst was the battle for liberation where practically the whole Poblacion of Urdaneta was destroyed, including the municipal building.\nAccording to Mr. Benigno M. de Guzman written on the 1973 Urdaneta Elective Officials Inauguration Souvenir Program, during the Japanese war bombing in December 1941, Mayor Patricio Abenojar ordered trenches to be dug behind the municipal building. In case of raids, the employees and other people would have a place to hide and protect themselves from exploding bombs.\nFurthermore, according to Mr. Isidro Ramos, as a result of this mass destruction, the Poblacion was razed to the ground. Naturally, after the war, reconstructions of private and public buildings started immediately.\nWhen Americans withdrew from the town, the municipal building started to be repaired slowly.\n\nC. Status: [ x ] Occupied	[ ] Not Occupied', 'According to Atty. Dionisio Antiniw, former City Councilor and City legal officer of Urdaneta City, the present-day location of city hall was a private-owned land by one of the prominent families in Urdaneta.  Four Doric posts similar to Greek architectural design were installed. Other posts were Roman\'s Corinthian column designs. Its windows were made of capiz with metal grills. Its rooks were made of fully corrugated steel while the ceiling was made of wood. The interior of the city hall\'s first floor was made of cement while the second floor was made of sagat and yakal woods. The old western wing used to face the national highway, right across the former jail house. Meanwhile, the eastern wing also faces the national road and is also where the Mayor’s Office is located. After several years, the building was upgraded and retrofitted under different mayors. The offices were renovated to be more accessible to the public. The engineering office made sure that all premises are constantly checked and fixed.\nThe building was renovated in 2013 under the administration of City Mayor Amadeo Gregorio E. Perez IV and restyled with a refreshing new look upon the original solid foundation with more pillars added to bring strength into balance in order to reflect the unceasing reforms and enduring progress in our City under the diligent and watchful care of our officials.\n', 'Historical significance\nFrom its establishment in 1915, it functioned as the seat of various government officials that aims to develop the community. The Old City Hall of Urdaneta is an institution that is continuously serving up until now the interests of the people of the city. \n\nAesthetic significance\nSurviving the test of time, the building is more than a hundred years old yet its aesthetic significance reflects an old Spanish style architecture that exudes elegance and modernity.\nSocioeconomic significance\nThe local government requires or determines an appraisal of the monetary value of real and personal properties and tax is assessed in proportion to that value.\nSocio-political significance\nThe Old City Hall of Urdaneta has been used as the seat of government of Urdaneta City from the administration of Municipal President Don Herminigildo Alonso up to the present. This is the building where they convene to plan and develop the progress of the city that will primarily benefit the people.\n\nC. CONSTRAINTS/THREATS/ISSUES: \nThe volume of vehicles coming from different places causes air pollution. Acid rain dissolves paint, accelerating the need for repairs and repainting, affecting the aesthetic appearance of the infrastructure. The structure was also hit by natural disasters like storms which caused minor damages to the building.\n\nD. CONSERVATION MEASURES: \n     The Old City Hall building is a strong building that is able to withstand the different calamities that hit the area. The City Government preserves the integrity of the building. The offices were renovated to be more accessible to the public. The engineering office made sure that all premises are constantly checked and fixed.\n', 'Good', 'The building has ongoing renovations.', 'Altered', 'The Old City Hall building is a strong building that can withstand the different calamities that hit the area.', '[]', 'KEY INFORMANT/S:\n\nATTY. DIONISIO ANTINIW\n80 years old, former City Legal Officer\nBrgy. Consolacion, Urdaneta City, Pangasinan\n\nEVELYN A. DELOS TRINO\n53 years old, City Engineer Tourism Officer\nBrgy. Palina East, Urdaneta City, Pangasinan\n\nENGR. RODOLFO NIDOY JR.\n55 years old, City Engineer\nTabuyoc Urdaneta City, Pangasinan\n\nMA. GRACITA B. ANDER\n61 years old, City Treasurer\nBrgy. Camanang Riverside, Urdaneta City, Pangasinan\n\nANNABELLE VELICARIA\n56 years old, DILG Staff\nBrgy. San Vicente, Urdaneta City, Pangasinan\n\nLUZ NOVENCIDO LOPEZ\n54 years old, Aksyon Center Staff\nBrgy. Nancayasan, Urdaneta City, Pangasinan\n\nREFERENCE/S:	\nChildren Summer Festival Souvenir Program 1958 (About our Cover by Isidro Ramos)\nUrdaneta Elective Officials Inauguration Souvenir Program 1972 (December, 1941, In Urdaneta by Benigno M. de Guzman)\n\n', 'Gemma B. Prestoza               	\nRamil San Juan                         	\nNerissa C. Tabion                    	\nRomela R. Montemayor       	\nJosephine B. Villoso               	\nHilda E. Lumague                    	\nSusana S. Corpuz\nMa. Editha Frias\nElenita Quinsay\nNorberto Discion \nFe Mary Anne Antonio\nPaola Sibayan\nNorberto Discion\nAtila Javier\nMylene Rosalin\nGerome Agas\nNatalie L. Blanquera\n', '2022-04-19', 7, NULL, '2025-02-22 03:51:47', '2025-03-08 04:00:37');
