(1, 'Tangible-Immovable Cultural Heritage', 'Ethnographic Object', 'PLANTSA', '[{\"photo_credit\":\"Michael Augie P. Mangaoang\",\"photo_date\":\"2022-05-21\",\"photos\":[\"featured-collections\\/1740167931-67b8dafb767ca-PLANTSA1.jpg\",\"featured-collections\\/1740167931-67b8dafb7694c-PLANTSA2.jpg\",\"featured-collections\\/1740167931-67b8dafb76a21-PLANTSA3.jpg\"]}]', '\"Household Items\"', NULL, NULL, NULL, NULL, NULL, NULL, 'The body is aluminum, while the handle is made of steel. It is called prensa de corona or crown press of its famous lid with a crown design.\nThis specific ironing material uses coal for heating. The crown press has a lock on the top lid to prevent the coal from spilling while ironing the clothes. The hook is also attached to the handle for additional protection. The lid has teeth shaped like a design for ventilation since the coal tends to transfer heat fast while the temperature is slightly hard to manage. \nThe item has a dimension of 20cm in length and, 10 cm in height, 9cm in thickness. The object’s color is brown, while its handle is painted red. It is slightly rusted from the bottom to the handle and repaired using a metal rod to keep things intact.\n', NULL, NULL, 'According to Ms. May Duarno, who uses the item in their household, the object is a big help, especially during scheduled and unscheduled power interruptions (a common occurrence in the countryside). They put coal to heat the thing and use it to iron out their clothes at home, sometimes with other chores where ironing is necessitated. Their neighbors often borrow the item since it does not require electricity and is a cheaper alternative to electric-powered ironing tools. She inherited the thing from her grandmother, and now she takes care of it. She continuously uses the object to prevent rusting and uses sandpaper and oil to remove the rusty parts.\nFor Mrs. Marites Ancheta, a crown press was a standard item in the household when they were young. The ironing object was their grandmother’s, but she could not remember who had inherited it.  Likewise, Sol Carino and Mr. Marvin Gayap stated that they used it a lot when they were kids. Often, their parents asked them to purchase coal for the crown press. At first, they were afraid of using it due to its hot temperature. Eventually, they learned how to tame and manage the heat. It was a big help to them, significantly reducing their electric bills. \nAccording to Agrepina Ancheta, the crown press was used to straighten their wrinkled clothes back in the old days. Almost everyone in Cabaruan was using it. Before they use it, they put smaller burning coal on top so it could light and spread the heat to the rest of the coal. You have to spray water on the cloth before using the crown and press thoroughly on the surface.  \n', 'A.	PRIMARY CRITERIA\nHistorical\nThe crown press was traditionally used in the household of Pangasinense, most specifically in the city of Urdaneta during the old times. It showcased the traditional living and the ingenuity of Filipinos prior to the advent of modern technology and power-dependent appliances. \n\nAesthetic\nThe crown press shows intricate ironwork and a design that reflects 20th-century craftsmanship. \n\nSocial\nThe item was shared and borrowed in the community. It symbolizes the frugal lifestyle of the Ilocano and Pangasinan people, it was also an item with a lot of meanings for older generations.\n\n\nB. COMPARATIVE CRITERIA\n	Rarity\nThis is a rare object in the City of Urdaneta because only a few would have this at home. The design was also a trademark of the PHILIMCO.\n', '[\"Fading\"]', 'The item is slightly rusted. Some parts have loosened and detached from the body. A metal rod is used to keep the parts and pieces intact.', 'B. THREATS/ISSUES/CHALLENGES:\nIt has no proper storage. \n\nC. CONSERVATION MEASURES:\nThe owner uses oil and sandpaper to clean out the rust and prevent other dirt from building up.\n', 'KEY INFORMANT/S:\n\nAGREPINA ANCHETA\n85 years old, Housewife\nBrgy Cabaruan Urdaneta CIty \n\nMAY DUARNA\n47 years old, Housewife\nBrgy Cabaruan Urdaneta City\n\nMARITES ANCHETA\n49 years old, Housewife\nBrgy Cabaruan Urdaneta City\n\nSOL CARIÑO\n50 years old, Housewife\nBrgy Cabaruan Urdaneta City\n\nMARVIN GAYAP\n42 years old, Sari-Sari Store Owner\nBrgy Cabaruan Urdaneta City\n', 'Carmela C. Meneses\nNatalie L. Blanquera\n', '2022-05-23', '1969-12-28', '52 years', 'May Duarna', 'Inherited', 2, '2025-02-22 03:58:51', '2025-02-24 14:11:22'),
(2, 'Tangible-Movable Cultural Heritag  e', 'Archival Holdings', 'WEDDING DAY PHOTO', '[{\"photo_credit\":\"Michael Augie P. Mangaoang\",\"photo_date\":\"2022-05-21\",\"photos\":[\"featured-collections\\/1740198841-67b953b955235-WEDDING DAY PHOTO1.jpg\",\"featured-collections\\/1740198841-67b953b95557c-WEDDING DAY PHOTO2.png\"]}]', '\"Photographs\"', '1970-11-04', '4', '3', 'Alphabetical', 'Patricia B. Garcia', 'Patricia B. Garcia', NULL, '[\"Lining\"]', 'The photo has slightly faded with tainted sides. The image is in landscape format.', 'According to Mrs. Patricia Garcia, 66 years old, the photo was taken in 1970 in front of Our Lady of Immaculate Concepcion in Urdaneta City. People in the picture were posing at the present-day location of the Virgin Mary.\nSalvador de Vera took the photo during Mr. and Mrs. Pedring Cabangon’s wedding. The couple was natives of Brgy. Pinmaludpod, Urdaneta City. Benson Garcia, 71 years old, vividly remembers what transpired on that day. In the photo, he identified the following person: Patricia Garcia, Salvador De Vera, Resuricion Eslava, Cording Gudoy, Benson Garcia, and Cherly De Vera. \nIn addition, Sherly de Vera, 67 years old, it was during the wedding when she and her friends decided to take a photo in front of the church. The people in the photograph remain close friends to this day. Cording Gudoy, 66 years old, was elated to see everyone on that occasion. It wasn’t easy to be in one.\nResurrection Eslava 68 years old, would reminisce whenever she saw the photo. She would relive her happy days with her friends. \n', 'PRIMARY CRITERIA\n\nHistorical\nThe picture was able to record the changes in the church structure, such as the old fountain and various new installments.\nOn November 4, 1970, the occasion happened in front of Our Lady of Immaculate Conception Cathedral Parish in Urdaneta City. The photo shows the changes in the church after it was devastated during the liberation bombing done by the Americans at the end of the second world war. The church was then renovated in 2000.\n\nAesthetic\nThe photo showcases the gradient and sepia art produced by the Rangefinder camera, which was a good material that encapsulates the said period’s street and theatrical photography practices. \nThe paper material is coated with resin and could withstand decades before it gets brittle. The quality reflects the standard material used, which can now be regarded as “vintage” or “retro” art. \n\nSocio-Spiritual\nThe photo showcases the importance of having Church weddings back then. The people in the picture have had memorable moments during the matrimony of their friends. \n\nCOMPARATIVE CRITERIA\n\nProvenance \nPatricia Garcia owns the photo. The photo was taken on November 4, 1970 outside the church of Our Lady of Immaculate \n\nConcepcion. \nRepresentativeness\nThe photo shows the method and materials involved in taking and processing photographs. It gives people, so delight to see older adults and places in a picture since cameras are hard to access and relatively expensive. \n\nRarity\nBecause of the technological boom, there are only a few surviving old photographs in the City of Urdaneta. \nInterpretative\nThe photo showcases simple traditional attires worn by the youth of the 70s. Meanwhile, the image also shows how empty the vicinity around the church is. There were no structures yet, only bushes of trees and gardens.\n', '[\"Fading\",\"Folds\"]', 'The photo has slightly faded with tainted sides', 'B. CHALLENGES/THREATS/ISSUES:\nThe photo has faded because of old age. It has generated black marks and wrinkled surfaces. Its paper is getting thinner over time. \n\nC. CONSERVATION MEASURES:\nThe owner puts the photo in a photo album where they kept most of their shots to preserve them. Aside from that, the owner would like to showcase the image to her descendants and grandchildren.\n', 'KEY INFORMANT/S:\n\nPATRICIA B. GARCIA\n66 years old, Housewife\nMatulong Manaoag Pangasinan\n\nBENJAMIN P. GARCIA\n67 years old, Farmer\nMatulong, Manaoag Pangasinan\n\nBENSON D. GARCIA\n71 years old, Farmer\nSan Jose Leet, Urdaneta City Pangasinan\n\nRESURICION C. ESLAVA\n68 years old, Housewife \nMetro Manila \n\nSHERLYN A. DE VERA\n67 years old, House Wife \nMetro Manila \n\nSALVADOR J. DE VERA\n67 years old\nSan Jose Leet Urdaneta City Pangasinan\n\nCORDING GUDOY \n66 years old, House Wife\nManaoag Pangasinan\n\nFRANCISCO P. GANADEN \n82 years old, Retired Priest \nRosales Pangasinan\n', 'Almer G. Baylon\nKaren A. Escat\nNatalie L. Blanquera\n', '2022-05-24', NULL, NULL, NULL, NULL, 1, '2025-02-22 12:34:01', '2025-02-24 06:31:31');
